(4900000328, 2, 1, '2015-06-20T15:00:09.546+03:00', '2019-03-17T18:36:40.968+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ватутина', '1700000.00', 'RUB', 1, 0, 3, 'Хорошее', '60', 'кв.м.', '0.00', '', 5, 3, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 328. Продается 3-х комнатная квартира, не угловая. Свежий ремонт, заменена электрика, двери, окна м/п.\nВ доме был кап. ремонт, 2009 г. Развитая инфаструктура, в шаговой доступности школа, садики, поликлиника, стадион, парк, турбаза Чайка, пляж.', 0),
