(4900000485, 2, 1, '2020-10-15T12:46:18.171+03:00', '2019-05-09T14:16:37+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Московская', '1400000.00', 'RUB', 0, 1, 3, 'Отличное', '40', 'кв.м.', '0.00', '', 5, 2, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 485. 2-х комнатная квартира в хорошем состоянии, металлопластиковые окна, 2-е сплит системы, натяжные потолки, совместный сан.узел, свой контур отопления,газовая плита и газовая колонка новые, многое оставляю! Капитальный ремонт дома, подъезда и подвала, Во дворе есть парковочное место для личного авто. Рядом вся инфраструктура.', 0),
(4900000490, 2, 1, '2016-05-14T20:31:53.312+03:00', '2019-03-29T20:16:49.437+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '1150000.00', 'RUB', 0, 1, 3, ' ', '41', 'кв.м.', '0.00', '', 3, 1, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 490. Предлагаем квартиры в строящемся 3-х этажном жилом доме, сдача дома в эксплуатацию октябрь 2016 года.Рядом с домом садик,школа,рынок. Качественное строительство ( облицовочный кирпич) \nСтройвариант 28000 тыс - кв.м.. включает:\n-индивидуальное газовое отопление с установкой котла и радиаторов;\n-ввод водоснабжения и канализации;\n-ввод электричества с установкой счетчика;\n-установка алюминиевых 2-х камерных и металлопластиковых тонированных окон фирмы KBE;\n-установка входных металлических дверей.\nВысота потолков 1 этаж-3,8м;2-3 этаж-3,1м.Огромная благоустроенная придомовая территория.\nЕсть место для детской площадки и парковок.Возможна отделка под ключ по договору', 2016),
