(4900000948, 2, 1, '2018-12-18T13:59:04.546+03:00', '2020-06-05T17:59:21.25+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Советская', '2000000.00', 'RUB', 0, 0, 3, ' ', '66', 'кв.м.', '0.00', '', 2, 3, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 948. Теплый и уютный четырехквартирный, одноэтажный жилой дом из белого силикатного кирпича расположенный на возвышенности с прекрасным видом на Цимлянское водохранилище (в 1000 метрах от пляжа, все необходимое для комфортного проживания установлено и имеется).\nС прилегающим участком земли (4 сотки), гаражем (кирпичный с железными воротами и стеллажами), сауной, летней кухней и хозпростройками.', 0),
(4900000949, 2, 1, '2018-12-18T14:19:42.281+03:00', '2020-07-26T14:11:05.968+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Советская', '5000000.00', 'RUB', 0, 0, 3, ' ', '136', 'кв.м.', '0.00', '', 2, 6, ' ', 0, 0, 0, ' ', 'Кат. №: 949. Район Ротонды\nДве спаренные квартиры\nСтоимость обоснована\nЗамена полностью: сантехника, электрика, пол, потолок, окна, двери.\nОтдельный собственный вход с верандой.\nДополнительно два тёплых подвальных помещения и гараж во дворе.\nИмеется техническая и юридическая возможность раздела на двух и трёх комнатные квартиры.\nВыход из квартиры в отдельную собственную беседку. Мангал, сад, виноград, сосны. \nВидеонаблюдение', 0),
(4900000952, 2, 1, '2020-06-29T21:43:24.39+03:00', '2019-06-13T18:36:13.39+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Карла Маркса', '1050000.00', 'RUB', 0, 0, 3, ' ', '58', 'кв.м.', '0.00', '', 5, 2, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 952. Не смотря на то, что дом не новый, находится в хорошем состоянии и расположен в самом центре города. Четвёртый этаж - золотая середина между шумными первыми этажами и и последним, находящимся под крышей. Ремонт делать не стали, поскольку вкусы с новыми хозяевами могут не совпадать, вместо этого ешили назначить справедливую цену. Торг уместен.', 0),
(4900000953, 2, 1, '2018-12-18T14:43:54.984+03:00', '2018-12-18T14:43:54.984+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '2100000.00', 'RUB', 0, 0, 3, 'Отличное', '60', 'кв.м.', '0.00', '', 5, 3, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 953. Квартира с ремонтом, металлопластиковые Окна + ( лоджия и балкон ), туалет ванна -плитка, сплит-система, частично с мебелью продажа.', 0);
