(4900001030, 2, 1, '2019-08-29T12:47:51.187+03:00', '2020-04-15T22:00:37.765+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Высоковольтная', '1299000.00', 'RUB', 0, 0, 3, 'Хорошее', '60', 'кв.м.', '0.00', '', 5, 4, 'Панельный', 0, 0, 0, ' ', 'Кат. №: 1030. СРОЧНО !!! Продам 4х-комнатную квартиру улучшенной планировки ( узаконена) Общая площадь 60 кВ.м. Жилая 40 кВ.м , кухня 9 кВ.м . \nТри комнаты изолированы , гостиная проходная, но, благодаря удобно расположенным дверным проёмам, пространство не «съедается». Из гостиной дверь в ещё одну уютную комнату.\nВ коридоре просторно и всегда порядок , так как сделана гардеробная во всю стену под потолок.\nВанна и туалет раздельные. Есть водонагреватель. Кухня была увеличена до 9 кВ.м , так что она достаточно просторная.\nМебель и часть техники остаются. \nКвартира в хорошем состоянии.\nНовая дорогая входная дверь.\nЭта квартира для тех , кто считает , что личное пространство должно быть как у детей и, тем более, у взрослых. \nНесколько лет назад в доме сделан капитальный ремонт , подъезды чистые , пластиковые окна везде, домофон. \nПодходит под материнский капитал \nТорг по факту и только с реальными покупателями', 0),
