(4900001081, 2, 1, '2020-04-09T02:44:50.14+03:00', '2020-05-20T22:54:03.468+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Морская', '2200000.00', 'RUB', 0, 0, 3, ' ', '59', 'кв.м.', '0.00', '', 3, 3, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 1081. Продаю трехкомнатную квартиру в маленьком курортном городке в экологически чистом зеленом районе. Дом кирпичный, отопление центральное. В подвале есть кладовая. Около дома фруктовый сад, цветники, спортивная площадка. Общая площадь квартиры 59,3 кв. м. (Большая гостиная, соединённая с кухней – (перепланировка узаконена) - 27,4 кв. м., спальня – 12,6 кв. м., кабинет (или вторая спальня) – 13,8 кв. м. с балконом, новая гардеробная). Один собственник.\nВо всех комнатах сделан качественный ремонт, отвечающий современным требованиям, имеются все счётчики.В квартире остаётся кухня со встроенной бытовой немецкой техникой (варочная панель, духовой шкаф, вытяжка), холодильник Toshiba, сплит - система, водогрейка. В ванной комнате – стиральная машина ELECTROLUX. Также остается новая дорогая мебель, хорошая посуда, настенный телевизор LG, компьютер, принтер и т. д. люстры, шторы, жалюзи. Заходи и живи! Просмотр в первой половине дня.', 0),
