(4900001086, 2, 1, '2020-04-09T03:38:43.375+03:00', '2020-04-15T18:53:39.578+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '1500000.00', 'RUB', 0, 0, 3, 'Жилое', '82', 'кв.м.', '0.00', '', 1, 5, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 1086. продам квартиру в доме с участком 10 сот. удобства в доме, большая кухня, три спальни, гостиная. Все коммуникации. Земля в собственности. К дому пристроен навес. Перед домом асфальтированная дорога. Рядом школа, магазины. До центра 300 м. Тихий район. На участке есть хоз пострйки для содержания животных, большой подвал. Имеется возможность строиться. Молодой плодоносящий сад. В доме остается мебель, заходи живи.', 0),
