(4900001089, 2, 1, '2020-04-09T03:53:53.312+03:00', '2020-04-09T03:53:53.312+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '1200000.00', 'RUB', 0, 0, 3, 'Отличное', '37', 'кв.м.', '0.00', '', 5, 1, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 1089. Продается однокомнатная квартира на 5-ом этаже 5-го кирпичного дома по ул.Ленина  (г.Цимлянск)\nДом расположен в хорошем районе города. \nКвартира теплая,светлая.В 2019 г был произведен косметический ремонт.\n\nЦена:1 200 000. Реальному покупателю торг уместен.', 0),
