(4900001131, 2, 1, '2020-03-13T18:13:03.234+03:00', '2020-05-04T19:24:04.156+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Высоковольтная', '1299000.00', 'RUB', 0, 0, 3, 'Хорошее', '60', 'кв.м.', '0.00', '', 5, 4, ' ', 0, 0, 0, ' ', 'Кат. №: 1131. Продам 4х-комнатную квартиру улучшенной планировки ( узаконена) Общая площадь 60 кВ.м. Жилая 40 кВ.м , кухня 9 кВ.м .\nТри комнаты изолированы , гостиная проходная, но, благодаря удобно расположенным дверным проёмам, пространство не «съедается». Из гостиной дверь в ещё одну уютную комнату.\nВ коридоре просторно и всегда порядок , так как сделана гардеробная во всю стену под потолок.\nВанна и туалет раздельные. Есть водонагреватель. Кухня была увеличена до 9 кВ.м , так что она достаточно просторная.\nМебель и часть техники остаются.\nКвартира в хорошем состоянии.\nНовая дорогая входная дверь.\nЭта квартира для тех , кто считает , что личное пространство должно быть как у детей и, тем более, у взрослых.\nНесколько лет назад в доме сделан капитальный ремонт , подъезды чистые , пластиковые окна везде, домофон.\nПодходит под материнский капитал\nТорг по факту и только с реальными покупателями.\nСобственник', 0),
(4900001132, 2, 1, '2020-03-13T18:27:31.796+03:00', '2020-06-05T17:45:23.062+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Геофизиков', '2000000.00', 'RUB', 0, 0, 3, 'Жилое', '77', 'кв.м.', '0.00', '', 2, 3, ' ', 0, 0, 0, ' ', 'Кат. №: 1132. Продаю 3-комнатную квартиру в г. Цимлянск Ростовской области в центре города.\nМаленький тихий городок юга России на берегу Цимлянского водохранилища. Жаркое лето, песочный пляж в пешей доступности (1км), обилие фруктов и овощей.\n1 этаж двухэтажного кирпичного дома. Дом после капитального ремонта, обшит сайдингом. 3 комнаты ( 18 м2, 19м2, 12м2), две смежные, одна раздельная. Есть коммерческая пристройка с отдельным выходом на улицу площадью 15 м2 ( можно использовать под магазин, салон, офис и тд...) Под двумя комнатами и пристройкой есть подвалы. Под окнами маленький участок земли. Во дворах 2 сарая с подвалами. В подъезде небольшое подсобное помещение под лестницей.', 0),
(4900001134, 2, 1, '2020-04-06T02:25:51.203+03:00', '2019-04-17T22:44:02.89+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Московская', '1400000.00', 'RUB', 0, 0, 3, 'Жилое', '58', 'кв.м.', '0.00', '', 5, 3, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 1134. Хороший район. Рядом два садика, дом расположен так, что все три школы находятся на одинаково удаленном расстоянии. Дом после капитального ремонта. Чистый подъезд. Хорошие, дружные и тихие соседи. Квартира теплая - не угловая (находится в серединке дома), светлая. В квартире сделан косметический ремонт, можно зайти и жить. Две комнаты изолированные, зал проходной. Балконный блок (окно и дверь) заменены на пластиковые, в остальных комнатах окна деревянные. Есть два подвальных помещения. Если у Вас есть малыш, на первом этаже есть место, где можно оставить коляску. Во дворе есть гараж, цена указана с гаражом. Реальным покупателям торг.', 0),
(4900001137, 2, 1, '2020-04-10T22:09:56.203+03:00', '2019-03-17T18:32:40.281+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '1800000.00', 'RUB', 0, 0, 3, ' ', '60', 'кв.м.', '0.00', '', 5, 3, ' ', 0, 0, 0, ' ', 'Кат. №: 1137. Продаётся трёхкомнатная квартира в кирпичном доме. Очень тёплая, не угловая, расположение бабочка, окна выходят во двор и на улицу. Две застеклённые лоджии, на одну выход из кухни и комнаты. Везде м/пластиковые окна, деревянные двери, на полу в кухне и ванной комнате плитка, в коридоре ламинат, в комнатах линолеум. В комнатах и коридоре жидкие обои. Сплитсистема LG, триколор. В собственности более 5 лет. Во дворе расположен новый детский сад, рядом школа, магазины.', 0),
(4900001138, 2, 1, '2020-05-04T19:12:58.656+03:00', '2019-03-10T13:34:43.937+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Московская', '1250000.00', 'RUB', 1, 0, 3, ' ', '41', 'кв.м.', '0.00', '', 5, 2, 'Кирпичный', 0, 0, 0, ' ', 'Кат. №: 1138. Продается картира! Дом после кап.ремонта. Все в шаговой доступности. Квартира теплая, чистый подъезд, хорошие соседи. В квартире остается вся мебель и техника что на фото (два дивана, шкаф, комод, холодильник, стиральная машина, сплит система). Звоните!!! Реальным покупателям за НАЛИЧНЫЙ РАСЧЕТ уступим!)', 0),
