(5000000180, 2, 1, '2014-06-18T20:03:36.531+03:00', '2019-04-01T14:47:57.015+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '1550000.00', 'RUB', 1, 0, 2, 'Хорошее', '47', 'кв.м.', '12.00', 'сот.', 1, 3, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 180. Продается частный домик 47 кв.м удобства в доме. Скважина и колодец. Вода в доме. Отопление газовое. Кухонька 18 кв. м. новая, В кухне тоже газ. Кап. ремонт дома в 2013 году. Крыша утеплитель и сайдинг .Подвал имеется. Участок 12 соток ухоженный. Садик и школа рядом. Сосновый бор. Идет расширение поселка!', 0),
(5000000181, 2, 1, '2014-06-18T20:11:35+03:00', '2020-01-26T19:42:12.671+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '2500000.00', 'RUB', 1, 0, 2, ' ', '330', 'кв.м.', '18.00', 'сот.', 0, 8, 'Кирпич', 0, 0, 1, 'Земли поселений', 'Кат. №: 181. Есть все коммуникации: газ, вода, свет, канализация. Земля в собственности. Подробности по телефону. Рассмотрю варианты обмена Торг.', 2008),
(5000000185, 2, 1, '2014-06-18T20:35:11.515+03:00', '2020-06-07T05:37:05.593+03:00', 'Россия', 'Ростовская Область', 'Крутой х.', 'Крутой х.', '1100000.00', 'RUB', 1, 0, 2, 'Хорошее', '71', 'кв.м.', '10.00', 'сот.', 1, 1, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 185. Продаётся кирпичный дом,со всеми удобствами.На участке 10 соток. Общая площадь 71 кв.м. Жилая 44.В доме газ,вода,паровое отопление.Состояние хорошее.На участке посажен молодой фруктовый сад, имеются хоз. постройки.Новый металический забор. Асфальтированный подъезд к дому.\nДом находится в одном километре от г.Цимлянск в х.Крутой.\nОколо 800 м находится Цимлянское водохранилище!', 0),
(5000000186, 2, 1, '2014-06-18T20:38:38.312+03:00', '2019-05-22T12:28:03.703+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '5500000.00', 'RUB', 1, 0, 2, 'Отличное', '115', 'кв.м.', '7.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 186. Сроч. Продаю или меняю в Цимлянске дом 115кв.м и действующий магазин 100кв.м,на 2х комнатную квартиру в Волгодонске с доплатой.7.7 соток земли,большой гараж,в черте города.СРОЧНО!!!!ВОЗМОЖЕН ТОРГ!!!', 0),
(5000000191, 2, 1, '2014-06-19T21:02:21.437+03:00', '2016-05-14T15:25:19.64+03:00', 'Россия', 'Ростовская Область', 'Хорошевская ст.', 'Хорошевская ст.', '2000000.00', 'RUB', 0, 0, 2, ' ', '197', 'кв.м.', '27.00', 'сот.', 2, 5, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 191. Продаю дом в Цимлянском районе , ст. Хорошевская . Зал и 4 комнаты,большая гостинная на первом этаже, и две большие комнаты на втором этаже. Так же есть хорошая баня. Два гаража, один в доме, другой на участке. Дом находится в живописном месте, на отвесном берегу моря, спускаться пять минут на укрытый от ветра песчаный пляж. Самое рыбное место Ростовской области, расположенное в 20 км от Волгодонска! Во дворе хозяйственные постройки и плодоносный сад, участка хватит для постройки нескольких домов. Очень удобное расположение, участки соседей расположены в умеренной удалённости. Красивое, уютное место!', 0),
(5000000193, 2, 1, '2014-06-20T01:36:51.484+03:00', '2019-05-23T10:35:00.187+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Комсомольская', '3000000.00', 'RUB', 1, 0, 2, ' ', '80', 'кв.м.', '11.00', 'сот.', 1, 3, 'Кирпич', 0, 0, 1, 'Земли поселений', 'Кат. №: 193. 1-этажный дом 80 м? (кирпич) на участке 11 сот., в черте города\nдом 80кв\\м. высота потолка 3м. участок 11сот. подвал под всем домом. во дворе колодец для полива.', 0),
(5000000194, 2, 1, '2014-06-20T01:53:35.921+03:00', '2020-08-19T15:29:48.484+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'МАССИВ ГЭС', '500000.00', 'RUB', 0, 0, 1, ' ', '18', 'кв.м.', '5.00', 'сот.', 0, 0, ' ', 0, 0, 1, 'Земли поселений', 'Кат. №: 194. Участок в р-не 1-й школы,прямой спуск к городскому пляжу.На участке есть 1-этажный деревянный домик 18 кв.м ,железная беседка,летний душ,сарай,фруктовые деревья.Подведён водопровод и свет,в этом году будет проведён газ. Подходит для строительства!', 0),
