(5000000443, 2, 1, '2015-03-18T14:02:17.703+03:00', '2016-10-06T04:54:36.562+03:00', 'Россия', 'Ростовская Область', 'Лозной х.', 'Лозной х.', '3100000.00', 'RUB', 1, 0, 2, 'Отличное', '160', 'кв.м.', '18.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 443. Экологически чистое место. Новый дом 2010г.постройки. Кирпичь, мин.плита, пеноблок.В 2-х уровнях. Цокольный этаж 80м.кв. Жилой этаж 80м.кв. Потолки дерево, ванна в кафеле. Все удобства в доме(газ,вода,отопление), теплые полы. В доме 3 комнаты (12,13,18 м.кв.) + Кухня 12 м.кв. С/у совмещен 5 м.кв. Усадьба 18 соток, плодоносящий сад, виноградник. Теплица 100 м.кв. Скважина. Ограждение металлический забор!', 0),
(5000000445, 2, 1, '2015-03-18T15:35:20.875+03:00', '2020-08-06T22:33:56.515+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Рябышева', '2800000.00', 'RUB', 0, 1, 2, 'Отличное', '90', 'кв.м.', '6.00', 'сот.', 1, 4, 'Кирпич', 1, 1, 1, 'Земли поселений', 'Кат. №: 445. Новый дом,под чистовую отделку,90 кв.м.,6,42 соток. Основа под забор установлена (предполагает 1 калитку и 2 заезда - в гараж и на территорию участка). Гараж -28 кв.м с погребом.Теплые полы немецкие, (зимой в доме \"ташкент\"!)-для себя, выбирались лучшие материалы; газовый котел;авторская просторная душевая кабина Год постройки - 2011. Расположен в живописном месте, близ Цимлянского водохранилища. Доступ к \"морю\" - 10 мин. хотьбы. На территории плодоносные деревья, виноград, малина и т.д., завозилась земля; также основательный фундамент для хоз. построек, бани и т.д. Проведен телефон и интернет, что неповсеместно для города!!!Продается в связи с переездом. Возможен торг.', 2011),
