(5000000483, 2, 1, '2015-03-27T19:44:18.059+03:00', '2020-07-25T16:00:27.828+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2000000.00', 'RUB', 1, 0, 2, 'Отличное', '50', 'кв.м.', '10.00', 'сот.', 1, 3, 'Кирпич', 1, 1, 1, 'Земли промышленности', 'Кат. №: 483. После кап. ремонта, сайдинг, утеплен, или меняю на двух комнатную квартиру с вашей доплатой. Дом кирпичный, опшитый сайдингом. Три комнаты, зал, две спальни,прихожая, каридор, кухня. Имеется большой гараж а так-же летняя кухня, проведена вся коммуникация, подвал, хоз. постройки, теплица, калодец для полива, молодой сад, виноградник, отменные сорта. За 2 мил. Возможен торг!', 0),
(5000000484, 2, 1, '2015-03-28T14:08:02.965+03:00', '2020-08-05T19:17:39.75+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '3000000.00', 'RUB', 1, 0, 2, ' ', '180', 'кв.м.', '7.00', 'сот.', 0, 5, ' ', 1, 0, 1, 'Земли сельхоз. назначения', 'Кат. №: 484. Продаю дачу на берегу Цимлянского водохранилища. рядом пляж. яхт клуб имеется свой вьезд к воде.Идеальное место для отдыха бизнеса и жилья.Есть проект на второй этаж.Недостроенный частично дом. Срочно!!!', 0),
