(5000000501, 2, 1, '2015-05-17T13:52:31.078+03:00', '2020-10-06T14:36:45.546+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2300000.00', 'RUB', 0, 0, 2, 'Хорошее', '120', 'кв.м.', '7.00', 'сот.', 2, 4, 'Блочный', 1, 1, 1, 'Земли поселений', 'Кат. №: 501. Дом достраивали, ничем не обшит с наружи, окна м/п. Гараж на две машины, недостроинный бассеин, можно использ под фундамент для дома', 0),
