(5000000514, 2, 1, '2015-05-28T13:08:34.64+03:00', '2016-10-06T04:16:13.546+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '3000000.00', 'RUB', 0, 0, 2, ' ', '274', 'кв.м.', '15.00', 'сот.', 4, 7, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 514. 4-этажный дом 274 м? (кирпич) на участке 15.2 сот., 7 км до города\nНовый жилой дом в п. Дубравный – готовность 80%, 4-ре уровня, в собственности,+ фундамент под гараж 6х12 с заливкой пола. Электричество; три фазы, 15 Квт., 380 вольт, разводка медь. Все розетки с заземлением рассчитаны на 3Квт., на каждом этаже свой эл. щит. Вода, очень хорошая; скважина пластик,28 метров. Газ по меже проект (оплачен). Септик; бетон. кольца с переливом на 6-ть кубов. Туалет на участке (капитальный), яма из блоков в мастике, на 8-мь кубов. Две бытовки 6х2,(одна мастерская, др. жилая, утеплена). Окна из дорогого ПВХ. Земельный участок в собственности, до грунтовых вод 7- мь метров. Тихое место, рядом лес, строили для себя.', 0),
(5000000515, 2, 1, '2015-05-28T13:11:22.671+03:00', '2018-04-24T15:32:27.75+03:00', 'Россия', 'Ростовская Область', 'Терновская ст.', 'Терновская ст.', '450000.00', 'RUB', 0, 0, 2, ' ', '30', 'кв.м.', '22.00', 'сот.', 1, 2, ' ', 0, 0, 1, 'Земли поселений', 'Кат. №: 515. Находится в цимлянском районе,станица терновская дом с летней кухней и земельным участком больше 20 соток.Свет,колонка и проведенная вода в дом.Также просторный гараж,сарай и большой подвал.', 0),
(5000000516, 2, 1, '2015-05-28T13:14:47.484+03:00', '2016-11-05T13:20:32.14+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '250000.00', 'RUB', 0, 0, 1, ' ', '0', '', '8.00', 'сот.', 0, 0, ' ', 0, 0, 1, 'Земли поселений', 'Кат. №: 516. земли поселений (ИЖС),участок в Саркеле. Срочно!', 0),
