(5000000525, 2, 1, '2015-05-28T13:59:43.875+03:00', '2016-10-06T03:51:09.703+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '375000.00', 'RUB', 0, 0, 1, ' ', '0', '', '11.00', 'сот.', 0, 0, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 525. 11.6 сот., земли сельхозназначения (СНТ, ДНП), в черте города\nЗемельный участок площадью 11,6 сотки на берегу Цимлянского водохранилища. Шикарный вид на море и город. Есть возможность купить сразу 3 земельных участка имеющих смежные границы. Первая и вторая линия от моря на выбор. Участки оформлены в собственность есть документы с юстиции. Свет оплачен, решается вопрос по газу и воде. Участки расположены в черте города Цимлянска. При покупке всех трех участков скидка!!! Рассмотрю варианты обмена', 0),
(5000000531, 2, 1, '2015-05-28T14:43:25.734+03:00', '2020-05-10T17:50:59.796+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Семашко', '850000.00', 'RUB', 0, 0, 1, ' ', '20', 'кв.м.', '8.00', 'сот.', 0, 0, ' ', 1, 1, 1, 'Земли поселений', 'Кат. №: 531. продается участок.Есть кирпичный гараж,отопление домика -газовая форсунка.вода во дворе (дом под снос) Фасад участка 22 метра!', 0),
(5000000532, 2, 1, '2015-05-28T14:48:05.234+03:00', '2019-06-05T18:30:52.593+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Свердлова', '2600000.00', 'RUB', 0, 0, 2, ' ', '92', 'кв.м.', '4.00', 'сот.', 1, 3, 'Блочный', 1, 0, 1, ' ', 'Кат. №: 532. Сроч. Продаю новый дом.Свет,газ,вода в доме.Рядом школа и детский сад.Выполнен из старооскольского кирпича,газоблок.Выполнена проводка.Продаю новый дом на стадии отделки.Свет,газ,вода,сливная яма,проводка,штукатурка,теплый пол...котел BOSH\nФотоотчет строительства есть,но лучше приезжать и смотреть,если интересует.\nКрыша-металлочерепица,кирпич старооскольский 1 сорт!', 0),
(5000000535, 2, 1, '2015-05-28T14:59:21.984+03:00', '2017-03-02T15:28:37.484+03:00', 'Россия', 'Ростовская Область', 'Терновская ст.', 'Терновская ст.', '400000.00', 'RUB', 0, 0, 2, ' ', '40', 'кв.м.', '16.00', 'сот.', 1, 2, 'Кирпич', 0, 0, 1, 'Земли поселений', 'Кат. №: 535. Дом в станице Терновская Цимлянского района свет,вода есть жилой. Есть хозпостройки летняя кухня 16 сот земли отдельный заезд для машины. Рядом школа,садик 400 м. залив Цимлянского водахранилища рай для рыбаков.', 0),
(5000000543, 2, 1, '2015-05-29T18:06:48.078+03:00', '2019-04-02T12:21:18.343+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '1300000.00', 'RUB', 1, 0, 2, 'Хорошее', '35', 'кв.м.', '3.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 543. Породам 1/2 дома в Цимлянске. Новая крыша и окна. Дом кирпичный. Ванна туалет в доме, газ, вода.Рядом школа, детский садик.Пол дома три комнаты ,зал,спальня,кухня,большая прихожая. Есть кладовка и подвал, воды в подвале нет 100%!!!! Есть хоз постройки, летняя кухня. Вход отдельный, место под гараж!', 0),
