(5000000872, 2, 1, '2016-04-18T11:57:24.703+03:00', '2020-10-21T14:55:09.734+03:00', 'Россия', 'Ростовская Область', '', 'хутор СТАРОПЕТРОВСКИЙ, Абрикосовая, 15 ПРОДАН', '500000.00', 'RUB', 0, 0, 2, ' ', '98', 'кв.м.', '16.00', 'сот.', 1, 4, ' ', 1, 1, 1, ' ', 'Кат. №: 872. Срочно! Продается - Дом (30 км от г.Цимлянска, 60 от Волгодонска) общая пл. 98 кв.м.\nДом большой, светлый, уютный, благоустроенный: газовое отопление, свет, вода, центральный водопровод, подвал, хоз. постройки, плодовый сад. \nДом расположен в пяти минутах ходьбы от центра, в центре поселка средняя школа, медпункт, детский сад, почта, магазины. \nХутор асфальтирован, имеется работающий дом культуры с бильярдом и библиотекой. \nИмеются свидетельства о регистрации на дом, строения, землю.\nТорг возможен.', 0),
(5000000879, 2, 1, '2016-04-18T19:09:40.375+03:00', '2020-07-14T12:47:23.312+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Серова', '2200000.00', 'RUB', 0, 0, 2, 'Отличное', '240', 'кв.м.', '6.00', 'сот.', 3, 7, ' ', 1, 0, 1, ' ', 'Кат. №: 879. 3-этажный дом 240 м? (экспериментальные материалы) на участке 6.3 сот., в черте города\nЖилой дом в г.Цимлянск, ввод в эксплуатацию 1999, монолитный керамзитобетонный с армированием 35мм.; высота потолков 3м.; дом строился на века; Зимой тепло, летом комфортно, отдельно стоящий гараж, двухуровневый подвал, хорошие соседи, спокойный и тихий район, улица без оживленного движения, черный выход, въезд во двор рольставни на пульте, 1-й этаж полы с водяным обогревом, газовое отопление, 2 надёжных и мощных котла, дополнительная утепленная 200 литровая ёмкость под горячую воду, трёх секционная не обслуживаемая канализация, Зимняя оранжерея (незаконченная) - длина 7,5м, ширина 4,5м, 3 уровня, вход с подвала; низкая ежемесячная плата за газ, свет, воду и небольшой налог; земля в собственности. Заходи и живи, по возможности облагораживать на свой вкус 2 и 3 этаж. Очень низкая цена, срочно, продаю в связи с переездом в другой город. Обмен.', 1999),
