(5000000884, 2, 1, '2016-04-19T15:56:05.609+03:00', '2017-02-11T17:44:17.421+03:00', 'Россия', 'Ростовская Область', 'Калининская ст.', 'Калининская ст.', '2500000.00', 'RUB', 0, 0, 2, ' ', '113', 'кв.м.', '15.00', 'сот.', 0, 4, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 884. Имеется гараж, хозпостройки, подвальное помещение, молодой сад, огорожен двор профнастилом с двух сторон; Газ (котел, водогрейка), вода, свет, стационарный телефон (интернет) - все оплаты в порядке; жилая площадь - 62.3; санузел совмещенный, кухня - 13.7, зал -21.3, гостиная - 10.5, 3 спальни - 13.6 и по 8.5, кабинет - 8.6, требуется косметический ремонт нежилой площади или подсобным помещениям по общей площади 18.9. Дом находится на Центральной улице, в 300 метрах от центра.\nДругая интересующая информация в телефонном режиме для реального покупателя!', 0),
