(5000000888, 2, 1, '2016-04-19T16:26:45.578+03:00', '2019-05-23T10:38:01.5+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '3500000.00', 'RUB', 0, 0, 2, 'Отличное', '130', 'кв.м.', '8.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 888. 1-этажный дом 130 м? (кирпич) на участке 8 сот., в черте города\nПродаю новый дом с итальянского кирпича. Дом строился для себя. Газифицирован. Очень тёплый. Натяжные потолки. Тёплые полы во всем доме - плитка. 2 спальни по 20 кВ.м, гостиная - 35 кВ.м, кухня- 17 кВ.м, холл - 8 кВ.м, гардеробная - 11 кВ.м, ванна(5,6 кВ.м) и туалет( 3 кВ.м) разделены. Дом под ключ, заходи и живи. Торг реальным покупателей.', 0),
