(5000000892, 2, 1, '2016-04-19T17:09:45.546+03:00', '2016-10-06T04:11:54.234+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Красноармейская', '13000000.00', 'RUB', 0, 0, 2, ' ', '310', 'кв.м.', '15.00', 'сот.', 2, 6, ' ', 1, 0, 1, ' ', 'Кат. №: 892. Продаётся два капитальных дома-(130 и 180 кв.м) на одном земельном участке в городе Цимлянске. На каждом этаже есть все удобства. В домах частично есть мебель.(вся мебель хорошая, дорогая) В каждом готовая кухня. Во дворе подсобные помещения, туалет, беседка капитальной постройки. Большой навес под парковку ав-то, автоматические ворота. Видео наблюдение по периметру, с воспроизведением и записью в доме на теле. Вальер для собаки. А так же деревянный городок для детей. ( домик со сруба, мостик, качели и разные животные) Весь двор в плитки, но земля для посадки присутствует. Всё в отличном состоянии. Цена 13 мл. руб. После осмотра небольшой аргументированный торг.))', 0),
