(5000000914, 2, 1, '2020-04-29T12:16:09.859+03:00', '2020-08-06T22:34:06.875+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Артемова', '2800000.00', 'RUB', 0, 0, 2, 'Хорошее', '80', 'кв.м.', '8.00', 'сот.', 1, 5, 'Кирпич', 1, 0, 1, 'Земли промышленности', 'Кат. №: 914. Сроч. Продаю дом в г. Цимлянск, Ростовской области. Дом расположен на земельном участке 8 соток. Общая площадь дома 80 кв.м, жилая 80 кв.м. Комнат - 5. Кухня 16 кв.м. В доме 2 отдельных выхода. Свет. Газ. Вода - централизованный водопровод. Отопление - газ. В 30 минутах ходьбы Цимлянское водохранилище. Зимняя кухня 25 кв.м., гараж 20 кв.м. Под домом теплый и сухой подвал, площадь 60 кв.м. Фруктовый сад, виноградник,огород, большой участок ремонтантной клубники.', 0),
