(5000000917, 2, 1, '2016-05-04T16:00:53.39+03:00', '2020-05-13T16:14:43.656+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Краснознаменная', '3990000.00', 'RUB', 0, 0, 2, 'Хорошее', '77', 'кв.м.', '13.00', 'сот.', 2, 3, ' ', 0, 0, 1, 'Земли поселений', 'Кат. №: 917. Сроч. Продаю два дома на участке 13 соток. Один дом полностью жилой. 2012 года постройки. В доме три жилые комнаты, кухня, ванная. Невероятно тёплый!! Второй дом 2х этажный строй вариант. Каркасный. 10х12. На участке плодовые деревья, малина, клубника и много кустов великолепного винограда. Или меняю на домовладение в Волгодонске.', 0),
(5000000918, 2, 1, '2016-05-04T16:07:33.812+03:00', '2020-09-25T22:33:22.64+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Суворова', '2800000.00', 'RUB', 0, 1, 2, 'Хорошее', '120', 'кв.м.', '8.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 918. Сроч. В городе Цимлянске продается кирпичный дом на большом земельном участке. В доме имеются, две просторные спальни, большой зал, гостинная(проходная комната), кухня(пол с подогревом) и предбанник. Ванная и туалет раздельные, так же есть кирпичный просторный гараж, летняя кухня неотапливаемая, но проведен газ. За домом расположен жилой флигель с отоплением, газом и водой. В флигиле три комнаты: спальная, кухня и гостинная, так же предбанник. На территории так же есть кирпичные строения такие как курятник, двухэтажный сарай с коптилкой, уличные туалет и душ. В душ проведена трубой вода, не нужно ведрами самостоятельно ее наливать. На территории есть пять рассредоточенных колонок, для удобного полива огорода. Оба дома отапливаются с одного котла. Все окна во всех строениях деревянные, но комнаты теплые. Полы везде новые. \nРассмотрим разные варианты продажи: полный бартер, бартер с доплатой и полностью оплата. Дом отлично подходит для большой семьи. Звоните!!!!', 0),
