(5000001113, 2, 1, '2016-09-23T15:45:48.64+03:00', '2020-04-09T19:41:23.078+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '5200000.00', 'RUB', 0, 0, 2, 'Отличное', '256', 'кв.м.', '13.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 1113. Продается 2-х этажный кирпичный дом (стена - 3 кирпича) на участке 13 соток, постройка 2006г. в г. Цимлянске (10 мин. от Цимлянского водохранилища, 20км. от г. Волгодонск, рядом река Дон - прекрасные места для отдыха и рыбалки); газ, центральное водоснабжение, канализация. Общ. пл.- 256 кв.м., столовая - 14 кв.м. со встроенной кухней, шесть комнат, большой холл, гараж с ямой, во дворе хоз.постройки, плодовые деревья, несколько сортов винограда. В шаговой доступности образ.учреждения, магазины, транспорт, больница.', 2006),
(5000001114, 2, 1, '2016-09-23T15:51:23.906+03:00', '2020-01-24T12:40:32.421+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '550000.00', 'RUB', 0, 0, 2, ' ', '20', 'кв.м.', '6.00', 'сот.', 1, 2, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1114. Продам дачу в черте города.\n(из документов: землеустроительное дело по межеванию земельного участка, технический паспорт на дачный домик, кадастровый паспорт земельного участка, свидетельство о государственной регистрации права).\nЗемельный участок 6 (60/10) соток (участок выровнен, удалены старые деревья и ненужная растительность), есть небольшой домик (полноценная кухня (есть большой холодильник), комната для хоз. инвентаря, две комнаты отдыха), пригоден для длительного проживания.\nТехническая вода, по улице проходит линия центрального водоснабжения, свет круглогодично, газ по меже (участвовали в прокладке газопровода по улице, подвод к дому при необходимости будет осуществлен за символическую плату) отличное место для отдыха с видом на море. 5 минут до городского пляжа, до центрального городского парка, до ближайшего супермаркета, до ближайшей остановки. Из плюсов, улица тупиковая (не проходная), постоянно проживающие замечательные, дружелюбные соседи.', 0),
(5000001115, 2, 1, '2016-09-23T16:57:20.25+03:00', '2019-03-21T16:57:12.75+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '1200000.00', 'RUB', 0, 0, 2, ' ', '60', 'кв.м.', '12.00', 'сот.', 1, 0, 'Кирпич', 1, 1, 1, ' ', 'Кат. №: 1115. Предлагаю купить домовладение, общ. пл. 60 кв.м, 3 комнаты (2 спальни, зал, столовая, веранда, кладовая, подвал), высокие потолки, отопление центральное газовое, вода- своя скважина, зем. участок 1 238 кв.м., во дворе летняя кухня, гараж, хоз. постройки, плодовые деревья. Дом светлый, уютный, хорошее состояние. Тихий эколокически чистый район. В шаговой доступности магазин, школа, детский сад, поликлиника. Возможен торг', 0),
