(5000001119, 2, 1, '2016-09-30T13:45:07.265+03:00', '2016-10-16T18:11:48.812+03:00', 'Россия', 'Ростовская Область', 'Лозной х.', 'Лозной х.', '165000.00', 'RUB', 0, 0, 1, ' ', '0', '', '10.00', 'сот.', 0, 0, ' ', 1, 0, 1, ' ', 'Кат. №: 1119. Продаю земельный участок под строительство жилого дома и ведение ЛПХ, площадью 1024 кв. м., находящийся по адресу: Цимлянский район, х. Лозной (5 км. от Цимлянска), Земельный участок находится в 50 метрах от леса (прямо напротив леса), в 300 от пруда, в 2.5 км от реки Сухая, в 5-6 км от реки Дон. Чистый воздух. Замечательное живописное место, где можно отдохнуть, погулять по лесу, собирать грибы, рыбалить, искупаться в чистейшей речке Сухая (приток р. Дона). Недалеко расположен природный заказник (остров). По меже участка проходит линия электропередач, рядом проходит газ. Примерно в 1-1.5 км. находится администрация хутора. Совсем рядом находится магазин. Хутор Лозной славятся чистой и вкусной водой. Хутор Лозной образует Лозновское сельское поселение Цимлянского района, В хуторе приобретают дома и дачи в основном жители г. Волгодонска и г. Цимлянска. Хутор Лозной - это не садоводство, поселение имеет инфраструктуру, магазины, школу, детский сад, почту, банк, администрацию. Цена 165 т. р. торг.', 0),
(5000001128, 2, 1, '2016-10-06T02:05:13.421+03:00', '2019-03-17T18:26:08.312+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Речная', '2700000.00', 'RUB', 0, 0, 2, 'Жилое', '68', 'кв.м.', '15.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1128. Продаётся дом кирпичный ПМЖ (общая площадь 68 кв.м.), во дворе жилая кухня (44 кв.м.), гараж, подвал, хозпостройки, колодец. Дом в отличном состоянии, подведён природный газ, отопление. Участок 15 соток, ухожен, много плодовых деревьев, кустарников, виноград. Недалеко протекает источник с питьевой водой (родник), рядом речка.', 0),
(5000001130, 2, 1, '2016-10-06T02:20:17.968+03:00', '2020-05-06T12:41:56.437+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '4000000.00', 'RUB', 0, 0, 2, 'Отличное', '316', 'кв.м.', '10.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1130. Сроч. СРОЧНО, в связи с переездом, продается двухэтажный коттедж. Общая площадь 316 м2, жилая - 236 м2. Отопление газовое (радиаторы+теплые полы), центральное водоснабжение, свет 3ф. Коттедж состоит из двух независимых жилых помещений - с отдельными входами, сан. узлами, кухнями; отопление - раздельное. Жилые зоны 1-го этажа - евроремонт, 2-ой этаж под отделку (коммуникации выведены). В доме предусмотрены баня с бассейном и парилка. Гараж на две машины, имеется смотровая яма. Также с гаража вход в подвал. Перед домом уложена тротуарная плитка, подъезд - забетонирован. На участке молодой плодовый сад, виноградные посадки. Дом полностью сдан в эксплуатацию, имеется свидетельство на право собственности (1 собственник), земельный участок приватизирован. Коттедж расположен в живописном месте, в непосредственной близости от \"Цимлянского моря\". Торг уместен.', 0),
