(5000001238, 2, 1, '2016-12-05T19:30:33.5+03:00', '2019-07-26T15:43:49.39+03:00', 'Россия', 'Ростовская Область', 'Маркинская ст.', 'Маркинская ст.', '850000.00', 'RUB', 0, 1, 2, 'Хорошее', '70', 'кв.м.', '12.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1238. Продается кирпичный дом общий метраж-70 м.кв. из 4-х комнат,две спальни,гостиная с камином,кухня-9 м.кв.,коридор,ванная комната и санузел-10 м.кв.В доме-новая крыша,новые окна,новый котёл,металлопластиковые трубы,железная дверь,кондиционер,телефон,интернет,телетарелка. Состояние комнат внутри: современный ремонт-7 новых окон,6 новых дверей,пол в комнатах-дерево + ДВП,на кухне и коридоре-новый дорогой ленолиум и пластиковый новый потолок,обои.Сантехника в хорошем состоянии.Коммуникации в наличии:газ,отопление-новый газовый котёл,вода в кухне и ванной,централизованное водоснабжение по счётчику.12 соток земли,на территории находится:гараж кирпичный,летняя кухня,погреб.Разбит сад с плодоносящими деревьями(орех,груша,яблоня,вишня,слива,черешня,алыча,виноградник).Перед домом-кусты роз,клубника.На заднем дворе находится курятник,крольчатник,сеновал,туалет,душ,другие хоз.постройки.Домовладение расположено в ст.Маркинская,на центральной улице,асфальтовая дорога,к дому ведёт вход-подъезд.Вблизи-300 м находятся-магазины', 0),
