(5000001680, 2, 1, '2017-10-05T18:04:52.281+03:00', '2020-09-07T11:40:05.781+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '3000000.00', 'RUB', 0, 0, 2, 'Хорошее', '148', 'кв.м.', '9.00', 'сот.', 2, 0, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1680. Дом новый 2014 г. постройки, полностью жилой, строил сам для себя не экономил. Дом теплый сухой и просторный, прекрасный вид на море (с двух этажной террасы) спуск к пляжу в 70 метрах, тихий район рядом детсад и школа. Интернет, WI-FI, спутниковое тв, сплит системы, все коммуникации влаживать ни чего не нужно заходи и живи. Во дворе дорожки парковка под 2 авто погреб беседка стационарный мангал коптильня летний душ туалет вольер для собаки плодоносящий сад и многое другое. Возможны варианты обмена продаём в связи с переездом.', 2014),
