(5000001691, 2, 1, '2017-10-26T19:08:43.187+03:00', '2018-03-06T15:53:34.406+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '395000.00', 'RUB', 0, 0, 2, ' ', '24', 'кв.м.', '8.00', 'сот.', 2, 0, 'Блочный', 0, 0, 1, ' ', 'Кат. №: 1691. Продам одноэтажный дом в п.Саркел Цимлянского района (в 3,5 км от г.Цимлянска) по адресу: ул.Социалистическая, 24 (недалеко от въезда в поселок). Общая площадь 23,7 кв.м (5,9м х 4,0м). Дом требует внутренней отделки. Электричество подведено, газ, вода рядом.\nОбщая площадь земельного участка - 803 кв.м (20,1м х 40м). Имеется достаточно места для строительства полноценного жилого дома, так как имеющийся домик расположен в самом конце участка.\nИ участок и строение находятся в собственности, свидетельства на руках. Разумный торг уместен.\nПо всем интересующим вопросам звонить в любое время.', 0),
