(5000001730, 2, 1, '2017-12-06T16:01:07.203+03:00', '2020-08-21T22:11:24.078+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Серова', '1900000.00', 'RUB', 0, 0, 2, 'Отличное', '64', 'кв.м.', '10.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1730. Продаю дом в отличном состоянии!, Подвал, ухоженный двор, посадки деревьев. В доме есть сплит, после ремонта, мебель оставляем!', 0),
(5000001734, 2, 1, '2017-12-10T15:18:47.734+03:00', '2019-06-21T15:22:02.64+03:00', 'Россия', 'Ростовская Область', 'Калининская ст.', 'Калининская ст.', '799000.00', 'RUB', 0, 0, 2, 'Жилое', '55', 'кв.м.', '14.00', 'сот.', 1, 4, ' ', 1, 1, 1, ' ', 'Кат. №: 1734. Продается квартира в двухквартирном жилом доме в ст. Калининская.Станица расположена на берегу Цимлянского водохранилища,где процветает рыбалка!!!До города Цимлянска 36 км.Материал дома ракушечник сверху штукатурка.Дом на участке 14 сот,площадь дама 55 кв м .В квартире 4 жилые комнаты(2 спальни,зал,комната для гостей),с/у с удобствами,кухня.В доме свет,вода,газ(котел),окна металлопластиковые. Во дворе большой навес,плодовые деревья и кустарники(малина,крыжовник,клубника). Также есть небольшие хоз постройки,туалет,уличная колонка для полива.Дом расположен в 5-ти минутах ходьбы от школы,магазинов и автобусной остановки.Возможен торг!!', 0),
