(5000001785, 2, 1, '2018-03-02T16:47:51.906+03:00', '2019-07-15T16:31:22.656+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Герцена', '7500000.00', 'RUB', 0, 0, 2, 'Отличное', '180', 'кв.м.', '0.00', '', 2, 7, ' ', 1, 0, 1, ' ', 'Кат. №: 1785. Продается дом, хороший дом - в трех уровнях. 2009 г был приобретен и основательно реконструирован. В цокольном этаже оборудована кухня столовая (летняя), вторая кухня есть и на первом этаже дома с встроенной кухонной мебелью. В цоколь-ном этаже установлен накопитель для питьевой воды на 500 л. В доме три санузла. Дом снаружи утеплен 30 мм пенополистиролом и покрыт штукатуркой \"короед\", выдерживая все технологические требования, благодаря этому дом очень теплый зимой и прохладно летом. В доме на 2 и на 3 уровне установлены две мощные сплит системы (производства LJ). К дому пристроен гараж на 2 машины (площадь 72 кв.м.) и баня (40 кв.м) на дровах с бассейном (размер бассейна 2х3,гл.1,9 м). В бане очень экономная печь, готовность с момента розжига 25-30 мин. Есть не большая дровница с дровами. Над гаражом сделана бильярдная, установлен большой профессиональный бильярдный стол 12 футовый (остается новому хозяину). В бане проведен теплый водяной трехконтурный пол, гараж отапливаемый, температура в зимний период не ниже +15 гр. В гараже установлены заточной станок и машинные хорошие тисы (остаются новому хозяину). В дом заведено электроснабжение 380V, распределено по этажно, на каждом этаже стоят распредшкафы с дифавтоматами, что очень безопасно (вся электроарматура установлена от производителя SNEJDER ELEKTRIK).', 0),
