(5000001857, 2, 1, '2018-06-15T14:20:13.593+03:00', '2019-05-17T17:05:17.546+03:00', 'Россия', 'Ростовская Область', 'Хорошевская ст.', 'Хорошевская ст.', '500000.00', 'RUB', 0, 0, 2, ' ', '49', 'кв.м.', '16.00', 'сот.', 0, 2, ' ', 0, 0, 1, ' ', 'Кат. №: 1857. Продается дом общей площадью 49,1 кв.м,жилой площадью 19,6 кв.м с земельным участком 16,1 сотки(все в собственности).Холодная вода в доме.Ванна.Сливная яма.Пластиковое окно. Новая проводка.На участке новые туалет и душ. Тыльная сторона участка огорожена новым металлическим забором из профнастила с раздвижными воротами(2017).На боковой стороне натянута новая сетка рабица.Имеется также нулевой цикл(фундамент) из армированного бетона под\nновый дом.На участке насаждений нет.Трава косится несколько раз в году.Материнский капитал подходит.', 0),
