(5000001860, 2, 1, '2018-06-15T14:42:14.203+03:00', '2018-06-15T14:42:14.203+03:00', 'Россия', 'Ростовская Область', 'Хорошевская ст.', 'Хорошевская ст.', '900000.00', 'RUB', 0, 0, 2, 'Хорошее', '70', 'кв.м.', '8.00', 'сот.', 1, 3, ' ', 0, 0, 1, ' ', 'Кат. №: 1860. Продам дом на берегу моря .В доме заменена вся электрика ,водопровод новый,крыша металлочерепица ,м/п окна ,водонагреватель на 50 л,газ по меже,большой подвал ,канализации,залитая площадка под 3 машины ,2 ворот ,плодовые деревья ,виноград,малина и т. д. .В том году была отсыпана дорога', 0),
(5000001861, 2, 1, '2018-06-15T14:57:05.578+03:00', '2018-06-15T14:57:05.578+03:00', 'Россия', 'Ростовская Область', 'Новоцимлянская ст.', 'Новоцимлянская ст.', '1400000.00', 'RUB', 0, 0, 2, ' ', '125', 'кв.м.', '16.00', 'сот.', 1, 3, ' ', 0, 0, 1, ' ', 'Кат. №: 1861. Продам дом х. Ремизов Цимлянский район 40 км от города. Дом 125 кв.м. В доме 4 комнаты, столовая, кухня, ванная, кладовая. Недавно был ремонт. В комнатах натяжные потолки, столовая, кухня, ванная в пластике. Остаются 2 сплит системы. Большой земельный участок, гараж, погреб, множество хозпостроек, молодой сад, скважина. Подробности по телефону. Цена договорная. Торг.', 0),
(5000001863, 2, 1, '2018-06-15T15:05:24.531+03:00', '2020-08-12T14:24:55.281+03:00', 'Россия', 'Ростовская Область', 'Лозной х.', 'Лозной х.', '2500000.00', 'RUB', 0, 0, 2, 'Хорошее', '91', 'кв.м.', '14.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 1863. Продаётся дом, Цимлянский район х. Лозной. В доме 3 жилые комнаты (2 спальни и большой зал), кухня с выходом в огород и спуском в погреб, туалет и ванна совмещённые в доме, есть небольшая сауна, рядом с домом гараж 4 на 6м. Ухоженный огород, во втором хоз. дворе, есть несколько построек для живности (свинарник, коровник, курятник). Дом с паем в собственности, все документы на руках.', 0),
(5000001866, 2, 1, '2018-06-15T15:33:08.468+03:00', '2020-02-09T14:48:45.218+03:00', 'Россия', 'Ростовская Область', 'Железнодорожный х.', 'Железнодорожный х.', '450000.00', 'RUB', 0, 0, 2, ' ', '50', 'кв.м.', '25.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 1866. Продам жилой дом в х.Железнодорожном Цимлянского района. В доме газ, вода. Паровое отопление. Кухня, веранда, гостиная и две спальни. Имеются хоз.постройки. Гараж, летняя кухня, погреб, летний душ. 50 м до остановки автобуса. В хуторе есть детский сад, школа, фельдшерский пункт, железнодорожная станция и большой элеватор. Магазин в 15 метрах. Подходит материнский капитал. Реальному покупателю торг.', 0),
(5000001867, 2, 1, '2018-06-15T15:37:42.937+03:00', '2018-12-12T13:10:51.203+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Чапаева', '6200000.00', 'RUB', 0, 0, 2, 'Хорошее', '300', 'кв.м.', '9.00', 'сот.', 2, 5, ' ', 1, 0, 1, ' ', 'Кат. №: 1867. СРОЧНО, продаётся дом на две половины общей площадью 300кв, каждая половина по 150кв, одна половина полностью жилая, вторая под отделку. Все коммуникации проведены(свет,вода,газ) счётчики установлены. Общая площадь земли 9 соток, все находится в собственности, один хозяин. Реальному покупателю хороший торг!', 0),
(5000001869, 2, 1, '2018-06-15T16:03:39.656+03:00', '2019-11-11T18:51:49.5+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '150000.00', 'RUB', 0, 0, 1, ' ', '49', 'кв.м.', '15.00', 'сот.', 1, 0, ' ', 0, 0, 1, ' ', 'Кат. №: 1869. Продам фундамент под жилой дом 8х8 на земельном участке 1500 кв.м. Участок в аренде. На участке есть свет, вода. Участок ровный, прямоугольный с небольшим уклоном.', 0),
(5000001870, 2, 1, '2018-06-15T16:10:16.218+03:00', '2018-06-15T16:10:16.218+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Заводская', '10000000.00', 'RUB', 0, 0, 2, ' ', '150', 'кв.м.', '10.00', 'сот.', 2, 5, ' ', 1, 0, 1, ' ', 'Кат. №: 1870. Новый дом на берегу р.Дон. Свой пирс , гараж , помещения для охраны, беседка с камином,в шаговой доступности от города 1.8 км .Газ , вода , свет , канализация , очень хороший ремонт', 0),
(5000001871, 2, 1, '2018-06-15T16:16:34.546+03:00', '2020-05-20T21:08:27.968+03:00', 'Россия', 'Ростовская Область', 'Терновская ст.', 'Терновская ст.', '900000.00', 'RUB', 0, 0, 2, 'Хорошее', '68', 'кв.м.', '15.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1871. Дом в ст. Терновская, Цимлянского р-на, Ростовской обл. До Цимлянска 25 км., до Волгодонска 49 км.\nКирпичный дом 68 м на участке 15.3 сот., погреб, подвал, кирпичный гараж, хоз. постройки. Фундамент под летнюю кухню. Двор выложен плиткой. \nВ доме 4 комнаты, плюс кухня, сан. узел, ванна, водопровод, газ, горячая, холодная вода, все коммуникации. Окна стеклопакеты. \nНа участке виноградник, плодовые деревья. В ста метрах от двора залив Цимлянского водохранилища. Остаётся мебель и домашняя техника. Рассмотрим все варианты оплаты.', 0);
INSERT INTO `offers` (`offer_id`, `type`, `property_type`, `creation_date`, `last_update_date`, `location_country`, `location_region`, `location_locality_name`, `location_address`, `price_value`, `price_currency`, `haggle`, `mortgage`, `category`, `quality`, `area_value`, `area_unit`, `lot_area_value`, `lot_area_unit`, `floors_total`, `rooms`, `building_type`, `heating_supply`, `sewerage_supply`, `electrecity_supply`, `lot_type`, `description`, `build_year`) VALUES
(5000001872, 2, 1, '2018-06-15T16:22:07.296+03:00', '2018-06-15T16:22:07.296+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Азина', '6100000.00', 'RUB', 0, 0, 2, 'Отличное', '156', 'кв.м.', '11.00', 'сот.', 1, 6, ' ', 1, 0, 1, ' ', 'Кат. №: 1872. Дом мансардный, 155,4 кв.м, одноэтажный, стены шлакоблок с наружной отделкой облицовочным кирпичем, 4 жилые комнаты: 16, 19, 23 кв.м и гостиная 34 кв.м. Все комнаты изолированы. Кухня 20 кв.м со встроенным кухонным гарнитуром и техникой Ariston. Санузел раздельный, ванная комната 10 кв.м. Под всем домом теплые водяные полы. Покрытие полов - ламинат + кафель, натяжные французские потолки в 2-х уровнях, сплитсистемы, на окнах - электророльставни. Коммуникации: вода, свет, газ, интернет, телефон, 2 канализационных септика. Отдельностоящий гараж с мастерской, стеллажами 41 кв.м Летняя кухня со встроенным кухонным гарнитуром 23 кв.м и крытой терассой 21 кв.м Хозблок со встроенными стеллажами 13 кв.м Летний туалет и летний душ кирпичные с внутренней отделкой ламинатом. Летняя теплица из поликарбоната 12 кв.м. Благоустроенная территория из тротуарной плитки 100 кв.м, цветники, крытая площадка для барбекю с мангалом-печью, летний каркассный бассейн на 18 куб. м с мощным песчаным фильтром, плодоносящий сад, экзотические ягодные кустарники, виноградники. Забор с лицевой стороны кирпичный с кованными элементами, по меже - профнастил, с тыльной стороны выход в благоустроенную балку-рощу. Дом находится в экологически чистом и тихом районе в центре города, хорошие соседи. Все подробности по телефону и при осмотре. Прямая продажа без посредников. Для реального покупателя возможен торг. Возможен вариант обмена на 3-х комнатную квартиру в новой Москве (Щапово) с нашей доплатой. Другие варианты обмена не рассматриваются.', 0),
(5000001873, 2, 1, '2018-06-15T16:25:14.187+03:00', '2019-06-21T00:33:51.671+03:00', 'Россия', 'Ростовская Область', 'Маркинская ст.', 'Маркинская ст.', '890000.00', 'RUB', 0, 0, 2, ' ', '120', 'кв.м.', '19.00', 'сот.', 2, 4, ' ', 0, 0, 1, ' ', 'Кат. №: 1873. Продам дом в ст. Маркинская. Газ и свет подведён, разводка воды по дому есть, однако необходимо будет пробурить скважину. Большой участок с плодовыми деревьями, гараж на одну машину с погребом. Есть хоз постройки, где можно держать хозяйство. В доме 4 комнаты на 1 этаже и 2 на втором. Кухня, санузел, веранда и прихожая, котельная, а так же чердак. В станице есть школа, детский сад, магазины, заправка. Все дороги, в том числе и подъезд к дому асфальтированы. Торг.', 0),
