(5000001877, 2, 1, '2018-06-15T16:56:58.359+03:00', '2020-09-04T13:34:54.125+03:00', 'Россия', 'Ростовская Область', 'Маркинская ст.', 'Маркинская ст.', '500000.00', 'RUB', 0, 0, 2, ' ', '55', 'кв.м.', '12.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 1877. Продаётся уютный домик в центре станицы Маркинская, по улице Ленина 9/1, рядом все удобства: магазины, школа, клуб, детская площадка. В Доме шесть комнат, включая ванную и кухню, проведены газ и вода, есть мебель, спутниковое ТВ и домашний телефон. Так же есть летняя кухня, погреб, сараи, свинарник и курятник. Все окна в доме металло-пластиковые, входная дверь железная новая. Большой огород и много фруктовых деревьев. Тихие, спокойные и дружелюбные соседи. Торг уместен. Можно за материнский капитал', 0),
