(5000001887, 2, 1, '2018-06-16T18:49:19.671+03:00', '2020-04-27T19:48:28.468+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '900000.00', 'RUB', 0, 0, 2, ' ', '65', 'кв.м.', '6.00', 'сот.', 2, 3, ' ', 0, 0, 1, ' ', 'Кат. №: 1887. На берегу. до пляжа 5 мин. до Центра 5 мин пешком! Жилой дом в трех уровнях. мансарда 15 м2. 1 этаж 2 комнаты по 12 м2, веранда 12 м2, подвал 12м2, отопление котел. Хоз.постройки: летняя кухня, два сарая из шлакоблоков, два навеса, \"удобства\" во дворе. Стоянка для авто. Вода для полива. Сад: виноградник, слива, яблони, абрикос, орех, вишня, смородина, земля для огорода. Дом и участок приватизированы. Можно прописываться. Школа рядом', 0),
