(5000001893, 2, 1, '2018-06-16T19:15:23.531+03:00', '2019-05-22T12:34:58.546+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Свердлова', '4200000.00', 'RUB', 0, 0, 2, 'Хорошее', '200', 'кв.м.', '0.00', '', 2, 5, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 1893. Дом 3х-этажный, 200 кв.метров, кирпичный, два отдельных входа (отдельно полноценная однокомнатная квартира), 3 спальни,3 санузла.Отопление газовое.Отдельная большая летняя кухня, теплица, погреб, 2 гаража. Участок 12 соток, 7,5 -ухоженный сад,прекрасный цветник. До пляжа турбазы 5 минут пешком', 0),
(5000001895, 2, 1, '2018-06-16T19:25:11.75+03:00', '2019-09-09T20:26:47.671+03:00', 'Россия', 'Ростовская Область', 'СОВЕТСКАЯ', 'СОВЕТСКАЯ', '0.00', '', 0, 0, 2, ' ', '70', 'кв.м.', '13.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 1895. Продается благоустроенный дом капитальной постройки. Дом теплый,светлый. Газовое отопление, водопровод центральный, канализация- септик. Есть хоз. постройки: баня, отдельная летняя кухня (16кв.м) с большим погребом ( стены и потолок выложенны красным огнеупорным кирпичем) (16кв.м), сарайки. \nНа участке растут плодовые деревья: яблони, абрикос, шелковица, вишня, орех и виноград . Земля плодородная. Сразу за участком лесопосадка. До Цимлянского водохранилища 6км. Школа, дет.садик, остановка, магазины, церковь все это в шаговой доступности (2-5 минут) . \nДОМ ПРОДАЕТСЯ СРОЧНО! Цена снижена на 300.000 руб.!', 0),
