(5000002029, 2, 1, '2018-12-20T01:59:43.25+03:00', '2019-05-22T12:36:11.593+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Донская', '4800000.00', 'RUB', 0, 0, 2, 'Отличное', '250', 'кв.м.', '8.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 2029. Продаю дом в центре г. Цимлянска в десяти минутах ходьбы до моря. тихий уютный район, в шаговой доступности магазины, рынок. Теплица, большой гараж с автоматическими воротами. Высокие потолки, просторные комнаты, два санузла. Пристроенная летняя кухня.', 0),
(5000002031, 2, 1, '2018-12-20T02:23:31.625+03:00', '2018-12-20T02:23:31.625+03:00', 'Россия', 'Ростовская Область', '', 'парамонов', '1400000.00', 'RUB', 0, 0, 2, 'Хорошее', '72', 'кв.м.', '15.00', 'сот.', 1, 4, ' ', 1, 1, 1, ' ', 'Кат. №: 2031. Дом в хорошем состоянии c большим участком, хоз.постройками и садом в Морозовском районе х. Парамонов. Дом одноэтажный, кирпичный общей площадью 72 м2, фасад отделан сайдингом, 4 комнаты,а также кухня со встроенной мебелью, ванная комната с ванной и унитазом, прихожая, гардеробная, кладовая. Участок 15 соток, на нем расположены: гараж, небольшая летняя кухня, хоз.постройки, погреб, летний душ, туалет, плодоносный сад, цветник, огород. В дом заведены все коммуникации: вода, свет, газ, отопление – котел. Вход в дом со двора, имеется терасса для отдыха с навесом. Также есть мебель, спутниковое телевидение, интернет, довольно свежий ремонт, металлопластиковые окна. Двор декорирован обилием роз. Насаждения – виноград, малина, клубника и пр. Плодовые деревья – яблони, слива и пр. Удобное расположение: до центра (школа, мед.пункт, магазины, дет.сад, дом культуры) - 10 минут пешком. Асфальтированные дороги. Расстояние населенного пункта до г. Морозовск - 49 км, г. Волгодонск - 55 км. Продажа в связи с переездом. ТОРГ возможен.', 0),
(5000002033, 2, 1, '2018-12-20T02:35:22.875+03:00', '2019-04-02T12:21:59.484+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '1490000.00', 'RUB', 0, 0, 2, ' ', '230', 'кв.м.', '62.00', 'сот.', 1, 6, ' ', 0, 0, 1, ' ', 'Кат. №: 2033. Уникальный земельный участок 62 сотки на самом берегу Цимлянского водохранилища с большим бетонным причалом. Расположен в городе Цимлянск, в 3 км от самого центра.\n\nКрасивейший ландшафт! Рядом песчаный пляж, а при желании можно организовать и свой собственный пляж. К участку подходит асфальтированная дорога.\n\nЕсть водопровод, электричество.\n\nНа участке есть бетонный фундамент для объект строительства площадью 230 кв.м. , а также фундамент еще для двух построек, все фундаменты в хорошем состоянии.\n\nНа участке можно построить коттеджи с причалом для себя или для аренды, базу отдыха, спортивно-развлекательный комплекс, лодочную станцию, яхтенную школу, питомник для декоративных растений или фруктовый сад, индивидуальное и производственное строительство, рыбопромысловое производство. \nДля участка есть разработанный проект базы отдыха с эллингом для яхт (см. несколько приложенных картинок).\nВозможна полная продажа участка с причалом, а также мы готовы рассмотреть формы сотрудничества и соинвестирования для развития проекта.', 0),
(5000002036, 2, 1, '2018-12-20T02:53:17.828+03:00', '2020-05-13T16:10:19.187+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Чапаева', '4100000.00', 'RUB', 0, 0, 2, ' ', '160', 'кв.м.', '10.00', 'сот.', 1, 4, ' ', 0, 0, 1, ' ', 'Кат. №: 2036. Покупалась коробка а дальше делал все сам для себя, продавать не планировал, дом готов под внутреннюю чистовую отделку. Дом и земля в собственности. Газ,вода, электричество проведено и все оформленно. Растянута вода на кухню, ванную и туалет (горячая и холодная), ванная и туалет отдельные комнаты .стоит отличный котел Аристон с чугунным теплообменником. Теплые полы сделанные правильно а не самопал, 2 зимы топил ( в среднем 1500р в месяц). Полы залиты чистовой стяжкой , стены отштукотурены. По вопросам звоните все расскажу , покажу фото что и как делалось( вел для истории) .', 0),
(5000002037, 2, 1, '2018-12-20T03:00:31.296+03:00', '2020-05-13T18:38:12.625+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '425000.00', 'RUB', 0, 0, 2, 'Жилое', '40', 'кв.м.', '12.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2037. Продается дом в хорошем состоянии ,в доме уютно, хороший сад , огород , много молодых деревьев и различные постройки по дворе, сарай, гараж , до Волгодонска 30 мин на машине , до Цимлянска 15 мин , рядом речка , лес , не далеко магазин, торг уместен .Можно за материнский капитал', 0),
(5000002038, 2, 1, '2018-12-20T03:02:49.375+03:00', '2019-06-20T20:28:47.984+03:00', 'Россия', 'Ростовская Область', '', 'Старопетровский ул Лютиковая', '850000.00', 'RUB', 0, 0, 2, 'Хорошее', '92', 'кв.м.', '0.00', '', 1, 4, 'Кирпич', 0, 0, 1, ' ', 'Кат. №: 2038. Продается дом на участке 16 соток. На участке есть два гаража. Имеються хоз постройки, для разведения крс. и птиц. Торг, и обмен на квартиру Волгодонске с нашей доплатой уместен.', 0),
(5000002040, 2, 1, '2018-12-20T03:16:31.281+03:00', '2018-12-20T03:16:31.281+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '2800000.00', 'RUB', 0, 0, 2, 'Хорошее', '110', 'кв.м.', '17.00', 'сот.', 1, 4, ' ', 1, 0, 1, ' ', 'Кат. №: 2040. Продаю дом 110 кв.п.Дубравный. После кап.ремонта. Свет, вода(хол.гор), газ. Туалет, душевая кабина в доме. Сплит система. Гараж под Газель. Хоз. постройки.Сауна. Сад, виноградник, речка. Развитая инфраструктура (дет.садик, школа, мед.пункт, магазины, АЗС, кафе). Продаю срочно. Торг.', 0),
(5000002041, 2, 1, '2018-12-20T03:21:28.625+03:00', '2020-05-16T21:01:57.375+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Краснознаменная', '4200000.00', 'RUB', 0, 0, 2, 'Хорошее', '200', 'кв.м.', '6.00', 'сот.', 2, 4, ' ', 1, 0, 1, ' ', 'Кат. №: 2041. Срочно продается 1/2 дома по ул. Краснознаменной. Первый этаж - гараж, кухня-столовая, санузел. Второй этаж - гостиная, 3 спальни, санузел. Третий этаж (мансардный) - спальня и игровая комната. Во дворе баня, большой навес (можно под вторую машину), беседка. Площадка возле дома и дорожки выложены плиткой. Торг.', 0),
(5000002042, 2, 1, '2018-12-20T03:34:49.593+03:00', '2020-09-07T11:31:56.421+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '4200000.00', 'RUB', 0, 0, 2, ' ', '316', 'кв.м.', '10.00', 'сот.', 2, 6, ' ', 1, 0, 1, ' ', 'Кат. №: 2042. СРОЧНО, в связи с переездом, продается двухэтажный коттедж. Общая площадь 316 м2, жилая - 236 м2. Отопление газовое (радиаторы+теплые полы), центральное водоснабжение, свет 3ф. Коттедж состоит из двух независимых жилых помещений - с отдельными входами, сан. узлами, кухнями; отопление - раздельное. Жилые зоны 1-го этажа - евроремонт, 2-ой этаж под отделку (коммуникации выведены). В доме предусмотрены баня с бассейном и парилка. Фасад дома готов под отделку. Установлена водосточная система. Гараж на две машины, имеется смотровая яма. Также с гаража вход в подвал. Перед домом уложена тротуарная плитка, подъезд - забетонирован. Навес. На участке молодой плодовый сад, виноградные посадки. Дом полностью сдан в эксплуатацию, имеется свидетельство на право собственности (1 собственник), земельный участок приватизирован. Коттедж расположен в живописном месте, в непосредственной близости от \"Цимлянского моря\". Рассмотрим обмен на недвижимость с Спб и области.', 0),
(5000002043, 2, 1, '2018-12-20T03:37:38.828+03:00', '2018-12-20T03:37:38.828+03:00', 'Россия', 'Ростовская Область', 'Кумшак х.', 'Кумшак х.', '2500000.00', 'RUB', 0, 0, 2, ' ', '250', 'кв.м.', '100.00', 'сот.', 2, 4, ' ', 0, 0, 1, ' ', 'Кат. №: 2043. Продаётся дом 250 м кв. без ремонта.В доме санузел, 2 подвала, спортзал, сауна. Во дворе хоз. постройки, баня, бассейн, большое тепличное хозяйство. Возможна продажа раздельно: дом и хоз. постройки или теплицы.', 0),
(5000002048, 2, 1, '2018-12-20T14:20:24.796+03:00', '2020-07-25T15:59:02.328+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2150000.00', 'RUB', 0, 0, 2, 'Хорошее', '100', 'кв.м.', '30.00', 'сот.', 1, 4, ' ', 1, 1, 1, ' ', 'Кат. №: 2048. Срочно!!! В связи с переездом!!!Продам новый дом мансардного типа в ст.Красноярская, Ростовской обл., Цимлянский р-он с мебелью. В доме газовое отопление (новый котел, счетчики заменены), окна-мпо, натяжные потолки, раздельный санузел. Котельная - 9кв.м., прихожая -10кв.м., кухня -18кв.м., зал -40кв.м., спальня -12 кв.м. Во дворе скважина, септик - 6куб., летний душ, туалет, хоз.постройки, гостевой домик, пруд, бассейн. Участок -30 сот., молодой плодоносящий сад - абрикос, яблоня, вишня, груша, слива, грецкий орех, фундук. Дом расположен в тихом месте на берегу р.Кумшак, рядом Цимлянское водохранилище. Магазины( Магнит, Пятерочка и др.), школа, дет/сад в шаговой доступности. Хорошие соседи, рыбалка. Документы готовы к продаже. Реальному покупателю хороший торг.', 0),
