(5000002059, 2, 1, '2019-01-30T12:00:33.312+03:00', '2019-07-26T15:42:26.828+03:00', 'Россия', 'Ростовская Область', 'Маркинская ст.', 'Маркинская ст.', '700000.00', 'RUB', 0, 0, 2, 'Хорошее', '68', 'кв.м.', '22.00', 'сот.', 1, 3, 'Дерево-брус', 1, 0, 1, ' ', 'Кат. №: 2059. Продаю теплый, просторный уютный дом со всеми удобствами в экологически чистом районе ростовской области.В доме газовое отопление батареи биметаллические пластиковые окна, туалет, ванная в доме,подвал под всем домом, крышу недавно делали скважина с питьевой водой.Во дворе имеются хоз. постройки,молодой сад фруктовых деревьев,виноградники клубника и.т.д. Улица крайняя рядом река очень удобно для рыбалки и разведения сельского хозяйства.Добрые и порядочные соседи.В станице есть детский сад школа до 11класса сам учился и очень доволен,больница аптека и.т.д.автобус ходит три раза в день до Цимлянска.Коммунальные платежи копеечные, что не мало важно для любой категории граждан.Земля находится в собственности.Продаю по причине покупки квартиры для мамы в Волгодонске поэтому возможен обмен с моей доплатой подходит ипотека материнский капитал(+) и.т.д.', 0),
(5000002060, 2, 1, '2019-01-31T17:36:48.406+03:00', '2019-11-15T15:21:20.89+03:00', 'Россия', 'Ростовская Область', 'Маркинская ст.', 'Маркинская ст.', '2500000.00', 'RUB', 0, 0, 2, 'Хорошее', '207', 'кв.м.', '30.00', 'сот.', 2, 6, 'Кирпич', 1, 1, 1, ' ', 'Кат. №: 2060. Продаю большой, качественный дом! Также во дворе имеется второй дом! Состояние хорошее, во дворе плитка, 3 теплицы, баня, гараж! Своя артецианская вода!', 2006),
