(5000002277, 2, 1, '2020-04-08T22:47:27.437+03:00', '2020-05-20T15:46:45.984+03:00', 'Россия', 'Ростовская Область', 'Терновская ст.', 'Терновская ст.', '750000.00', 'RUB', 0, 0, 2, ' ', '50', 'кв.м.', '17.00', 'сот.', 1, 3, ' ', 0, 0, 1, ' ', 'Кат. №: 2277. Продается дом в станице терновская в центре рядом магазин. Общая площадь дома 49,8 м2 жилая площадь 28,7м2 не жилая 21м2,также в доме имеется газ, вода, ванная. Во дворе 17 соток земли, есть летняя кухня в которой также есть газ,хоз постройки, гараж, теплица, туалет и душ. Соседи дружелюбные. Все вопросы по телефону. Можно за материнский капитал+ваша доплата. Также торг уместен.', 0),
(5000002278, 2, 1, '2020-04-08T22:51:06.656+03:00', '2019-04-02T12:16:13.734+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Калинина', '1350000.00', 'RUB', 0, 0, 2, ' ', '85', 'кв.м.', '8.00', 'сот.', 1, 4, 'Блочный', 0, 0, 1, ' ', 'Кат. №: 2278. Новый частный дом. Строил для себя. Качественно, с продуманной планировкой. \nЗемля ровная, плодородная. \nПродаю дешево, потому что срочно нужны деньги. \nВсе вопросы по телефону', 0),
(5000002281, 2, 1, '2020-04-09T15:04:05.75+03:00', '2020-05-19T21:40:54.921+03:00', 'Россия', 'Ростовская Область', 'Камышевская ст.', 'Камышевская ст.', '1050000.00', 'RUB', 0, 0, 2, ' ', '83', 'кв.м.', '20.00', 'сот.', 1, 4, ' ', 0, 0, 1, ' ', 'Кат. №: 2281. Продаю дом в ст. Камышевской, Дом кирпичный, два выхода, на улицу и во двор, четыре комнаты, кухня, туалет, ванна, большое чердачное помещение - вход из кухни,окна ПВХ, отопление автономное печное, можно провести газ. К дому пристроен большой гараж с ямой. Имеются хоз.постройки. Во дворе недостроенная летняя кухня, под ней большой хороший погреб. Первое фото старое, в настоящее время деревья выросли, закрывают дом.Торг', 0),
(5000002283, 2, 1, '2020-04-09T15:38:39.406+03:00', '2020-06-15T14:40:12.562+03:00', 'Россия', 'Ростовская Область', 'Крутой х.', 'Крутой х.', '750000.00', 'RUB', 0, 0, 2, ' ', '113', 'кв.м.', '15.00', 'сот.', 1, 4, ' ', 1, 0, 1, ' ', 'Кат. №: 2283. Жилой дом требует ремонта. Все коммуникации в доме. Возле дома колодец, большой навес, гараж. Имеется летняя кухня', 0),
(5000002285, 2, 1, '2020-04-09T15:49:05.093+03:00', '2019-06-01T16:29:20.437+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '700000.00', 'RUB', 0, 0, 2, ' ', '33', 'кв.м.', '17.00', 'сот.', 1, 2, ' ', 1, 0, 1, ' ', 'Кат. №: 2285. Продается дом 33 м2, земля в собственности 17 соток. В доме одна комната 16м2, кухня, сан-узел и котельня. Пластиковые окна, газовое отопление, сплит система. Вода в доме горячая и холодная. На участке есть сад. Срочно!! Реальному покупателю Торг.', 0),
