(5000002291, 2, 1, '2020-04-09T16:44:59.453+03:00', '2019-04-19T21:28:28.921+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '800000.00', 'RUB', 0, 0, 2, ' ', '30', 'кв.м.', '7.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2291. Вода, газ, летняя кухня с газом, отопление форсунка! Летняя беседка с водоемом. 400 метров от водохранилища. Садик, школа, магазины. Возможен торг!', 0),
(5000002292, 2, 1, '2020-04-09T16:53:53.921+03:00', '2020-04-09T16:53:53.921+03:00', 'Россия', 'Ростовская Область', 'Новоцимлянская ст.', 'Новоцимлянская ст.', '350000.00', 'RUB', 0, 0, 2, ' ', '62', 'кв.м.', '20.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2292. Продаеться частный дом, в ст. Новоцимлянская 46км от г. Цимлянска. Дом находиться в центре станицы, в шаговой доступности ДК, школа, детский сад, почта, 3 продуктовых магазина. В доме есть газ, вода. На участке имеються хоз построики. без торга.', 0),
