(5000002294, 2, 1, '2020-04-09T17:04:18.484+03:00', '2019-03-24T17:35:01.218+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2850000.00', 'RUB', 0, 0, 2, ' ', '99', 'кв.м.', '8.00', 'сот.', 1, 5, ' ', 1, 0, 1, ' ', 'Кат. №: 2294. Продаю дом 98.6 кв с удобствами светлый,тёплый,уютный.\nСделан современный ремонт.Все коммуникации подведены.\nПод всем домом обустроен цокольный этаж.Хоз.постройки новые в отличном состоянии.Земли 8.5 соток,виноградник,молодые плодовые деревья.Ухоженный двор.Имеется двухэтажное строение: на первом этаже утеплённый гараж,на втором недостроенные жилые помещения.Удобное расположение дома,в шаговой доступности: рынок,магазины,больница,аптеки,школа,детский сад и т.д. \nАсфальтированная улица.Реальному покупателю скидка.Продажа в связи с переездом.', 0),
(5000002295, 2, 1, '2020-04-09T17:21:13.843+03:00', '2020-04-09T17:21:13.843+03:00', 'Россия', 'Ростовская Область', 'Крутой х.', 'Крутой х.', '1050000.00', 'RUB', 0, 0, 2, ' ', '60', 'кв.м.', '11.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2295. Продаю дом в х.Крутом.Все коммуникации в доме газ,вода.телефон стационарный, центральный водопровод(колонка для полива на улице).Хоз.постройки,гараж,летняя кухня..Обмен на квартиру в г.Цимлянске рассмотрим все варианты или продажа.', 0),
(5000002296, 2, 1, '2020-04-09T17:33:47.703+03:00', '2020-04-09T17:33:47.703+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Красноармейская', '10000000.00', 'RUB', 0, 0, 2, ' ', '185', 'кв.м.', '15.00', 'сот.', 2, 5, ' ', 0, 0, 1, ' ', 'Кат. №: 2296. Домовладение 125+185 частично с мебелью. Кухни со встроенной техникой', 0),
(5000002298, 2, 1, '2019-03-06T19:59:52.656+03:00', '2019-03-06T19:59:52.656+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '1200000.00', 'RUB', 0, 0, 2, ' ', '40', 'кв.м.', '2.00', 'сот.', 1, 2, ' ', 0, 0, 1, ' ', 'Кат. №: 2298. Продаю 1/2 дома.40 кв.м. 2 сот.земли. Газа нет. Имеется проект на газ. 2 комнаты,небольшая кухня,санузел совместный.Новая электропроводка, новая сантехника, новая электроотопительная система.Сделан ремонт кроме обоев. Хороший район.Рядом с городской больницей.Цена 1.2млн.', 0);
INSERT INTO `offers` (`offer_id`, `type`, `property_type`, `creation_date`, `last_update_date`, `location_country`, `location_region`, `location_locality_name`, `location_address`, `price_value`, `price_currency`, `haggle`, `mortgage`, `category`, `quality`, `area_value`, `area_unit`, `lot_area_value`, `lot_area_unit`, `floors_total`, `rooms`, `building_type`, `heating_supply`, `sewerage_supply`, `electrecity_supply`, `lot_type`, `description`, `build_year`) VALUES
(5000002299, 2, 1, '2020-04-09T17:58:49.656+03:00', '2020-06-16T17:38:24.625+03:00', 'Россия', 'Ростовская Область', 'Калининская ст.', 'Калининская ст.', '2000000.00', 'RUB', 0, 0, 2, ' ', '144', 'кв.м.', '28.00', 'сот.', 2, 5, ' ', 1, 0, 1, ' ', 'Кат. №: 2299. Дом (144 м?) на земельном участке (2802,33 м?) с мансардой (есть возможность благоустроить 2й этаж), с пристроенной беседкой (отделка «Вагонкой», пластиковые окна, газовая плита), с пристроенным гаражом для одного автомобиля и навесом для двух автомобилей (электроподъёмные ворота с пультом управления). В доме установлены пластиковые окна, 2 шкафа-купе (4м и 2м), отопление пластиковое (3 года), кондиционер; крыша металлопрофильная (1 год). Мебель частично можно оставить за разумную дополнительную плату. Дом газифицирован энергооснащён (2хфазка и 3хфазка). Двор огорожен металлопрофилем (4 года).\nНа земельном участке расположена теплица (8 м), баня-недострой (требуется внутренняя отделка), уличный душ, большой погреб, действующая скважина (вода на улицу и в дом - нет проблем с Водоканалом), 2 сливные ямы, обложенные кирпичом; при этом двор выложен тротуарной плиткой (300 кв.м.), включая подъезд к гаражу и калитке. Также имеется плодоносящий сад, виноградник (крупный столовый), декоративные растения (можжевельник, туя, бонсаи, голубая ель и другие дорогостоящие растения).\nХоздвор под навесом благоустроен 3-мя сараями с забетонированными полами, столяркой (50 кв.м.), холодильной установкой (рефрижератор-контейнер 77 м? - за дополнительную плату).рассмотрим любые варианты обмена.', 0),
(5000002300, 2, 1, '2020-04-09T18:03:34.406+03:00', '2020-04-27T15:15:39.312+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '750000.00', 'RUB', 0, 0, 2, ' ', '33', 'кв.м.', '6.00', 'сот.', 3, 2, ' ', 1, 0, 1, ' ', 'Кат. №: 2300. Жилой дом в ст. Красноярская 39кв.метров. Из коммуникаций - свет, газ, колодец водворе и есть возможность врезки в водопровод. Есть хозпостройки, большой подвал. Участок 6 соток земли, ухоженный с молодым садом. Возможен расчёт материнским капиталом. Обмен не рассматриваем. Земля в собственности, все документы на руках, дом готов к продаже. Возможен торг. До магазина, остановки, заправки 50 метров.', 0),
(5000002301, 2, 1, '2020-04-09T18:32:20.703+03:00', '2020-01-26T10:40:01.515+03:00', 'Россия', 'Ростовская Область', 'Лозной х.', 'Лозной х.', '2370000.00', 'RUB', 0, 0, 2, ' ', '93', 'кв.м.', '24.00', 'сот.', 1, 4, ' ', 1, 0, 1, ' ', 'Кат. №: 2301. Дом в х. Лозной. кирпичный, 4 изолированные комнаты, санузел в доме, подвал, 2 гаража. Газ,свет,вода сетевая+скважина.Участок 24 сотки, ухоженный, плодоносящий сад, виноград, теплица. Есть хозпостройки для подсобного хозяйства. Свежий косметический ремонт(обои и т.д.), заходи и живи. В хуторе есть поликлиника, магазины, школа,дет.сад,почта, ходит автобус. Рядом лес, речка, прекрасные места для отдыха и рыбалки. Все в собственности.Документы готовы. До Цимлянска 6 км. Торг при осмотре.', 0),
(5000002303, 2, 1, '2020-04-09T18:56:00.843+03:00', '2020-04-09T18:56:00.843+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '20000000.00', 'RUB', 0, 0, 2, ' ', '314', 'кв.м.', '17.00', 'сот.', 2, 7, ' ', 1, 0, 1, ' ', 'Кат. №: 2303. Продам дом в живописном месте города Цимлянск, на берегу реки Дон. Общая площадь 313.6 кв.м., 3 спальни, столовая, 2 санузла, гостиная, спортзал, бассейн, сауна, все коммуникации: водоснабжение, канализация, свет, газ, кондиционеры, видеонаблюдение, интернет. Дом полностью мебелирован, Во дворе гараж на 2 машины, автоматические ворота, во дворе плитка. Забор из кирпича, газоны, ландшафтный дизайн из хвойных деревьев, просторная беседка и зона барбекю. Вода из собственной скважины. установлена охранная сигнализация', 0),
(5000002305, 2, 1, '2020-04-09T19:05:04.968+03:00', '2020-01-26T21:15:45.906+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '2300000.00', 'RUB', 0, 0, 2, ' ', '150', 'кв.м.', '30.00', 'сот.', 2, 5, ' ', 1, 0, 1, ' ', 'Кат. №: 2305. Домовладение в пос. Дубравный. Удобное и красивое место. Дом после кап. ремонта.Заменены полностью отопление, водоснабжение, эл. проводка, канализация, кровля, окна и двери, фасад (с утеплителем на два этажа). Внутри сделан косметический ремонт. Пристроена мансарда с тёплым полом. Молодой сад, большой виноградник. Две скважины (новые), система капельного полива. Хоз. постройки (навес 8х8м, гараж, курятник, погреб), два заезда для авто. Отопление газовое. Разумный торг.', 0),
(5000002306, 2, 1, '2020-04-09T19:10:43.546+03:00', '2019-04-02T20:11:17.703+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Лермонтова', '1600000.00', 'RUB', 0, 0, 2, ' ', '60', 'кв.м.', '8.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2306. Продаю дом в хорошем месте, рядом школа, детский сад, магазины. В шаговой доступности рынок и пляж Цимлянского водохранилища. На территории участка расположен колодец (позволяет экономить воду во время полива), кирпичный (газифицированный) флигель. В доме газовое отопление, водоснабжение (душ и туалет в доме), новая канализационная яма. Под домом большой и сухой подвал. Все счетчики. Подробности по телефону. Торг.', 0),
(5000002308, 2, 1, '2020-04-09T19:26:57.39+03:00', '2020-04-09T19:26:57.39+03:00', 'Россия', 'Ростовская Область', 'Калининская ст.', 'Калининская ст.', '1650000.00', 'RUB', 0, 0, 2, ' ', '83', 'кв.м.', '20.00', 'сот.', 1, 3, ' ', 0, 0, 1, ' ', 'Кат. №: 2308. В самом центре станицы продаётся участок с домом. Во дворе хоз постройки. Участок ровный, через забор администрация, мед пункт. В шаговой доступности школа, магазины. Место отлично подойдёт как для проживания так и для ведения коммерческой деятельности (под магазин, бар, производство..) Вода заведёна на участок. Свет и газ по меже. До моря 800 метров,два пруда в шаговой доступности. Реальным покупателям торг.', 0),
(5000002309, 2, 1, '2020-04-09T19:36:40.328+03:00', '2019-04-19T21:40:25.89+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '900000.00', 'RUB', 0, 0, 2, ' ', '100', 'кв.м.', '3.00', 'сот.', 1, 3, ' ', 1, 0, 1, ' ', 'Кат. №: 2309. 3-х комнатный дом-квартира\nВысота:2,70м\nИмеется:сарай,подвал и гараж\nГаз,вода подключены\nТорг\nСейчас в доме никто не проживает', 0),
