(5000002400, 2, 1, '2020-10-21T20:25:35.5+03:00', '2020-07-25T16:01:08.484+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2200000.00', 'RUB', 0, 0, 2, ' ', '185', 'кв.м.', '4.00', 'сот.', 2, 5, ' ', 0, 0, 1, ' ', 'Кат. №: 2400. В новом микрорайоне в ст. Краснояровской, продается 2-х этажные дома с лоджиями и гаражами, а также земельными участками на которые Вы можете выйти из дома. В домах очень много сета и воздуха. Очень хорошее предложение. Цимлянское море не далеко.\nВ доме на первом этаже на полу, выложена керамическая плитка с подогревом, в санузле, выложена кафельная плитка на полу и по стенам, метапластиковые, прочная лестница. Дом под чистовую отделку.\nЛучше посмотреть, а то я не так опишу или Вы не так поймёте.\nМикрорайон жилой.', 0),
(5000002401, 2, 1, '2020-10-21T20:39:49.671+03:00', '2020-10-21T20:39:49.671+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', ' ', '315000.00', 'RUB', 0, 0, 1, ' ', '20', 'кв.м.', '6.00', 'сот.', 1, 2, ' ', 0, 0, 1, ' ', 'Кат. №: 2401. Продается дачный участок с домиком. Домик небольшой, без отопления, только для сезонного времяпрепровождения. Свет проведен, вода подается по расписанию для полива 6 дней в неделю, неподалеку есть газ. На участок завозился чернозем, имеется много плодовых деревьев (яблони - 6 шт., сливы - 2 шт., черешня 1 красная и 1 желтая, груша 1 шт., огромный орех, много смородины, огромное количество малины и клубники, крыжовник, все перечисленное плодоносит прилично (при хорошем уходе соответственно). Во дворе летний душ, туалет, сарай для инвентаря. Продаем в связи с переездом в другой город. Торг уместен.', 0),
