(5000002422, 2, 1, '2020-01-04T19:57:33.187+03:00', '2020-05-24T23:46:03.406+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Артемова', '3950000.00', 'RUB', 0, 0, 2, ' ', '280', 'кв.м.', '6.00', 'сот.', 0, 5, 'Кирпич', 1, 0, 1, 'Земли сельхоз. назначения', 'Кат. №: 2422. Продаю уютный, светлый, комфортный дом. Цокольный этаж - 110 кв.м, гараж на две машины, котельная, теплое помещение и холодное помещение для хранения овощей, фруктов, консервации. Подъем с цокольного этажа на первый этаж дома, по внутренней лестнице. Первый этаж - 110 кв.м, прихожая, коридор, две большие спальни, гостиная, кухня-столовая, туалет, ванная. Высота потолков цокольного и первого этажа - 3 метра. Второй этаж - помещение 60 кв.м, не оборудовалось и не использовалось для проживания.\nНа территории участка имеется баня, летний туалет, очень хороший виноград различных сортов, плодоносящие деревья, много цветов.\nТорг.', 0),
