(5000002429, 2, 1, '2020-02-21T21:45:53.328+03:00', '2019-04-02T20:13:11.156+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Буденного', '1700000.00', 'RUB', 0, 0, 2, ' ', '80', 'кв.м.', '8.00', 'сот.', 2, 4, ' ', 0, 0, 1, 'Земли поселений', 'Кат. №: 2429. строй вариант тогр все вопросы по тел', 0),
(5000002430, 2, 1, '2020-02-24T00:02:17.343+03:00', '2020-02-24T00:13:33.562+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Маяковского', '8000000.00', 'RUB', 0, 0, 2, 'Отличное', '240', 'кв.м.', '8.00', 'сот.', 2, 5, 'Кирпич', 1, 0, 1, ' ', 'Кат. №: 2430. Продаю дом в центре г. Цимлянска. Общая площадь 241 кв.м, два этажа. В доме сделан качественный ремонт, красивая веранда, в доме центральная канализация. Красивый ухоженный двор. Во дворе гараж, прекрасная мангальная зона и зона отдыха. Дом предлагается к продаже с мебелью (встроенная кухня Дриада, с бытовой техникой). Отличная инфраструктура, рядом школа, сад, магазины, рынок. Торг уместен.', 0),
(5000002431, 2, 1, '2020-10-08T16:17:04.734+03:00', '2019-04-01T22:30:51.265+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Октябрьская', '1550000.00', 'RUB', 0, 0, 2, ' ', '70', 'кв.м.', '9.00', 'сот.', 0, 4, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 2431. Дом находится в новом, только застраивающемся районе. Год постройки 2019, адрес октябрьская78. Обмен на квартиру по договоренности.ЗА КЛАТБИЩЕМ.', 2019),
(5000002432, 2, 1, '2020-03-07T16:02:25.531+03:00', '2020-09-07T11:33:54.375+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '2501000.00', 'RUB', 0, 0, 2, ' ', '74', 'кв.м.', '11.00', 'сот.', 0, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2432. Продается дом на два хозяина в Ростовской области, Цимлянского района в п.Саркел (в 4 км от города) на берегу Цимлянского водохранилища (частично с мебелью). Общая площадь 74 кв.м, жилая 51,9 кв.м, высота потолков 250 см. 3 комнаты, все изолированы. В доме: сетевой газ, сетевой водопровод, туалет и ванная (совместно), канализация местная (септик), энергосберегающие окна (термальные), стационарный телефон и интернет. Имеются счетчики на газ, воду и свет. Дом теплый, комнаты светлые и просторные. Во дворе есть кирпичные строения:летняя кухня, большой гараж, котельная, сарай, большой подвал, а также туалет на улице и хоз.постройки. Перед гаражом и кухней находится шикарная летняя беседка из винограда. Двор и дорожки выложены плиточкой. В огороде имеется теплица; растут яблони, груша, черешня, слива, малина, клубника, ежевика. Дом расположен в удобном месте: 100 м от школы и остановки. К дому имеются два подъездных пути. Торг уместен.', 0),
(5000002434, 2, 1, '2020-03-07T16:50:26.25+03:00', '2020-03-07T16:50:26.25+03:00', 'Россия', 'Ростовская Область', 'Паршиков х.', 'Паршиков х.', '390000.00', 'RUB', 0, 0, 2, ' ', '60', 'кв.м.', '15.00', 'сот.', 1, 4, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 2434. Продаю хороший жилой дом. Газ. Водопровод. Отопление. Новый котел и водогрейка. потолок хорощий не низки. 4 комнаты кухня. Хоз построики. Курочки зернодробилка. Возможно под материнский капитал. Ипотека. Торг', 0),
(5000002435, 2, 1, '2020-03-09T20:01:57.781+03:00', '2019-05-22T12:18:35.625+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '5000000.00', 'RUB', 0, 0, 2, ' ', '138', 'кв.м.', '4.00', 'сот.', 1, 5, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 2435. Продаю 2-х этажный дом в центре г. Цимлянск, центральная улица Ленина на берегу Цимлянского водохранилища. Строй-вариант. Дом строился для себя только из лучших качественных материалов. Толстые кирпичные стены из забутовочного кирпича+облицовочный кирпич, армированные фундамент и оба армопояса, плиты перекрытия, лестница бетон, стены оштукатурены по маякам, крыша с Немецкой мягкой черепицы Docke, крыша из бруса и качественного леса, утеплена каменной ватой 20 см, водосливная система по периметру всего дома, снегозадержатели, энергосберегающие окна из Немецкого профиля Schuco, широкие Немецкие подоконники DANKE уже куплены на все окна, вентиляция, Центральная канализация!!!, разводка света, газ подключен, вода, интернет-стекловолокно. Подъезд к дому на 3 машины. Закрытый металлопрофильный забор. Отличная планировка, 3 спальни, небольшая гардеробная, французские окна в пол в гостинной, терраса с выходом во двор, 2 санузла, кабинет, кухня (12 м. кв.) и гостиная совмещенные. - Развитая инфраструктура: детские сады, школа, аптеки, сетевые магазины (Магнит, Пятерочка, Покупочка), СберБанк. Всё в шаговой доступности. Дом очень стильный, классно смотрится. Чем больше я буду влаживать в строительство, тем дороже будет становиться цена. Рассмотрю вариант обмена на квартиру в г. Волгодонск только в новостройках.', 0),
(5000002436, 2, 1, '2020-03-11T21:00:46.281+03:00', '2019-05-18T11:31:32.078+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '1900000.00', 'RUB', 0, 0, 2, ' ', '60', 'кв.м.', '7.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2436. Срочно!!! Продаю дом в связи с переездом в другой город. Дом кирпичный, теплый, 2013 года с мебелью. В доме 3 комнаты, есть выход на 2 этаж, можно сделать мансарду или утеплить. Все удобства, комнаты раздельные, во дворе септик, скважина. В шаговой доступности остановка, магазины, аптеки, амбулатория. Торг уместен', 2013),
(5000002437, 2, 1, '2020-03-13T15:22:40.906+03:00', '2020-06-06T12:47:40.171+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '1250000.00', 'RUB', 0, 0, 2, ' ', '36', 'кв.м.', '12.00', 'сот.', 1, 2, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 2437. Сделан капитальный ремонт, газ, свет, вода, тёплый пол, гараж под грузовую технику, подвал, большой участок. Все вопросы по телефону. Возможен разумный торг!', 0),
