(5000002442, 2, 1, '2020-03-13T16:41:44.89+03:00', '2019-04-02T12:11:41.234+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Азина', '1390000.00', 'RUB', 0, 0, 2, ' ', '30', 'кв.м.', '8.00', 'сот.', 0, 2, ' ', 1, 0, 1, 'Земли поселений', 'Кат. №: 2442. Продаю не большой домик в жилом массиве. Используем его в качестве дачи.В доме центральный водопровод и газ. Отопление-газовая печь-форсунка. Так же имеется газовая плита. Оконный кондиционер.В доме есть комната, кухня и коридор к которому подведена центральная канализация, но пока не подключена, постепенно планируем довести это дело до конца и обустроить полноценный сан. узел, на данный момент туалет и душ с подогревом на улице. Дом утеплён, обшит сайдингом, так же не давно менялась крыша полностью. Во дворе имеются капитальные хоз. постройки, исполненные по типу рабочих бытовок, сделанные собственными руками на совесть, утеплены минватой, снаружи оцинкованный профиль, внутри ЦСП и фанера, полы из доски 40 мм. Под одним сараем находится не большой погреб. Так же во дворе имеются два каркаса из профильной трубы 6 на 6 и 4 на 3, накрытые теневой плёнкой, для защиты растений. По мимо этого есть: беседка, печь-мангал, качели, хороший сад из плодовых деревьев, виноград и т.д. Так же отдельно имеется возможность приобретения соседнего прилегающего участка размером так же 8 соток с ориентировочной ценой 600 тыс. На котором находится дом под снос. Контакты соседки имеются. Таким образом в общей сложности вы имеете возможность приобрести 16 соток с выходом на две улицы-Азина 85 и Восточную 42. Торг имеет место.', 0),
(5000002444, 2, 1, '2020-05-09T21:48:34.671+03:00', '2019-05-22T12:33:19.828+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Лазоревый', '4500000.00', 'RUB', 0, 0, 2, ' ', '200', 'кв.м.', '7.00', 'сот.', 0, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2444. Дом новый с черновой отделкой , обложен красным кирпичом.Есть цокольный этаж,кухня-гостиная, две спальни, сан.узел.В цокольном этаже две комнаты и две кладовки.Участок огорожен проф настилом,септик есть, газ подведен,котел установлен,отопление разведено по дому,теплый пол в доме.Перед домом забор из красного кирпича.Участок высокий,не обработан.Окна пластиковые стекло пакеты,400 м до Цимлянского водохранилища.Продажа в связи с переездом.Строили для себя ,качественно.Перед домом и во дворе стоянка для авто залита бетоном.Торг!!', 0),
(5000002448, 2, 1, '2020-04-03T17:36:08.781+03:00', '2020-08-05T19:09:01.765+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Буденного', '3900000.00', 'RUB', 0, 0, 2, ' ', '80', 'кв.м.', '9.00', 'сот.', 0, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2448. Продается хороший, теплый дом в связи с переездом в другой город. Год постройки 2009. Площадь 80,2 / 50,5 / 16. До школы, д/сада 15 минут. Сделан ремонт по индивидуальному проекту. Качественная электропроводка и отопление. Окна ламинированный Rеhаu с противовзломным механизмом. Межкомнатные двери с покрытием из натурального шпона Intеsа. Натяжные потолки. Пол - ламинат Таrкеt. На кухне линолеум. Небольшой подвал. Котел 2-х контурный Воsh. 84 секции радиаторов. В 2019 году заменены счетчик газа и воды. Во дворе вибропрессованная плитка (Неss strоу). Залит фундамент под кирпичный мангал. Металлический каркас беседки. Канализация септик - система 2-х ям. Гараж 6*4. Мастерская. Небольшой сарай. Большой плодоносящий сад. Вишня (2), черешня (2), персик (2), слива (3), яблоня (5), груша, шелковица, абрикос (2). Большое разнообразие плодовых кустарников (7), виноградник, огород. Асфальтированная улица. Хорошие соседи. Возможна продажа с мебелью. Торг уместен. Просьба звонить после 14:00', 2009),
(5000002449, 2, 1, '2020-04-03T18:59:07.546+03:00', '2020-04-03T18:59:07.546+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Белинского', '6500000.00', 'RUB', 0, 0, 2, ' ', '140', 'кв.м.', '8.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2449. Продаю 2-х этажный дом. Ввод в эксплуатацию 1997 год. Один собственник. На участке имеются хоз. постройки, 2 гаража, навес для машины, навес для досуга, летняя застекленная беседка с неё вход в летнюю кухню. Все дорожки выложены тротуарной плиткой. Новая качественная крыша т.к делалось все для себя. Видеонаблюдение. В доме имеется подвал 24м2. Все оставшиеся вопросы по телефону.', 0),
