(5000002478, 2, 1, '2020-09-07T11:55:15.062+03:00', '2019-03-17T18:13:09.234+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '2400000.00', 'RUB', 0, 0, 2, ' ', '72', 'кв.м.', '9.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2478. Я собственник.\nПродаю кирпичный дом в центре города. Расположение у дома замечательное, рядом садик, школа, магазины.\nВ доме тепло, установлен газовый котел. Также установлена газовая колонка, для горячего водоснабжения. В доме есть ванная и санузел. Дом площадью 72кв/м, 4 комнаты. Окна М/П. Спокойные и добрые соседи. Под домом имеется подвал, изнутри подвала пол дома утеплен. Есть чердак, крыша не течет, дома сухо. Никаких тараканов и прочей живности нет. Участок 9 сот. На участке также имеется небольшой гараж и летняя кухня площадью в 45кв/м - там имеется газ, санузел, 2 комнаты. Сейчас кухня используется под склад разных вещей, как будем выезжать - все заберем с собой. Из минусов - нет центральной канализации, но услуги ассенизатора стоят не дорого. К дому уже подведен оптоволоконный кабель - уже есть быстрый интернет.\nПродавать буду только через местное агентство \"Эксперт\" на ул. Ленина в Цимлянске, и никак иначе.\nЕсть видео-обзор дома изнутри, если интересно, пишите, отправлю вам в личные сообщения. Звоните/пишите по любым интересующим вас вопросам, в любое время.\nОбмен не интересует. Небольшой торг уместен', 0),
