(5000002524, 2, 1, '2020-10-17T16:28:54.859+03:00', '2019-05-22T12:16:08.453+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Виноградный', '5000000.00', 'RUB', 0, 0, 2, 'Хорошее', '316', 'кв.м.', '10.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2524. СРОЧНО, в связи с вынужденным переездом, продается двухэтажный коттедж от собственника. Общая площадь 316 м2, жилая - 236 м2. Отопление газовое (радиаторы+теплые полы), центральное водоснабжение, свет 3ф. Коттедж состоит из двух независимых жилых помещений - с отдельными входами, сан. узлами, кухнями; отопление - раздельное. Жилые зоны 1-го этажа - евроремонт, 2-ой этаж под отделку (коммуникации выведены). В доме предусмотрены баня с бассейном и парилка. Фасад дома готов под отделку. Установлена водосточная система. Гараж на две машины, имеется смотровая яма. Также с гаража вход в подвал. Перед домом уложена тротуарная плитка, подъезд - забетонирован. Навес. На участке молодой плодовый сад, яблоки, алыча, слива, виноградные посадки. Дом полностью сдан в эксплуатацию, имеется свидетельство на право собственности (1 собственник), земельный участок приватизирован. Дом строили для себя, все сделано качественно. Всю необходимую мебель в т.ч кухню оставляем, можно заезжать и жить. Коттедж расположен в живописном месте, в непосредственной близости от \"Цимлянского моря\".Рассмотрим обмен на недвижимость с Спб и области, торг уместен.', 0),
