(5000002536, 2, 1, '2020-06-05T18:15:50.781+03:00', '2020-06-05T18:15:50.781+03:00', 'Россия', 'Ростовская Область', 'Саркел п.', 'Саркел п.', '4900000.00', 'RUB', 0, 0, 2, 'Хорошее', '209', 'кв.м.', '8.00', 'сот.', 2, 6, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2536. Продается мебелированный просторный и светлый загородный дом, с хорошим ремонтом, площадью 209.8 м2, на участке 7.5 сот в коттеджном поселке Саркел. Расположен в шаговой доступности от Цимлянского водохранилища. Дом 2х этажный, постройки 2013 года, кирпичный, с видом на водохранилище и базы отдыха. В доме 6 просторных комнат с новой мебелью и необходимой бытовой техникой, есть интернет, спутниковое телевидение, мебель входит в стоимость дома. Имеется подвальное помещение с полками для хранения.\nКоммуникации: центральное водоснабжение, индивидуальная канализация, электроснабжение, газовый котел, центральное газоснабжение. На участке есть дополнительные постройки: гараж для 2х машин, большой навес для отдыха, летний душ, каркас для объёмной теплицы, забор из бутового камня. На территории высажен плодоносящий сад и цветник.\nКатегория земли: земли населенных пунктов.', 2013),
(5000002538, 2, 1, '2020-06-05T18:46:30.781+03:00', '2019-03-20T14:44:09.843+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Калинина', '2150000.00', 'RUB', 0, 0, 2, ' ', '170', 'кв.м.', '6.00', 'сот.', 2, 4, 'Блочный', 1, 0, 1, 'Земли поселений', 'Кат. №: 2538. Продам качественный дом в г. Цимлянске. Дом в черновом варианте в двух уровнях. Свет в дом заведён. Разводка в доме вся медная Заведена вода и канализация. Подводится газ. Окна очень качественные металлопласт. Сделана качественная крыша. Стены газоблок. Дом делали для себя и денег не жалели. Продажа по семейным обстоятельствам в связи с переездом, а так бы никогда не продали. Дом 170 м.2, земля 6 соток. Возможен обмен на однокомнатную или двухкомнатную квартиру в г. Волгодонске. Осталось много строительного материала, который хранится в доме для дальнейшей стройки, а именно утеплитель технониколь, газоблок, доски различных размеров, брус, щебень.', 0),
(5000002539, 2, 1, '2020-06-05T18:56:45.234+03:00', '2020-06-05T18:56:45.234+03:00', 'Россия', 'Ростовская Область', 'Сосенки п.', 'Сосенки п.', '2700000.00', 'RUB', 0, 0, 2, 'Жилое', '92', 'кв.м.', '0.00', '', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2539. Продается дом в Цимлянском районе п.Сосенки.В доме газ,свет,вода.Сан узел раздельный.Во дворе летняя кухне.Гараж.Большой хоз двор.Рядом с домом детский сад,амбулотория.Речка.лес', 0),
(5000002540, 2, 1, '2020-06-05T19:08:01.609+03:00', '2020-06-05T19:08:01.609+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Кооперативный', '8000000.00', 'RUB', 0, 0, 2, 'Хорошее', '250', 'кв.м.', '14.00', 'сот.', 2, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2540. Продам жилой благоустроенный дом,общая площадь 250 кв.м,14,1 соток земли,с ухоженной территорией , жилая кухня , гараж, сад с плодовыми деревьями,виноград. Район тихий,все в шаговой доступности:магазины, аптека,банк,спортивный комплекс,бассейн.До центра города 5 минут, до моря 10 минут. Подъезд с 2-х сторон участка.возможно размежевание,звоните,отвечу на все интересующие вопросы. Торг.', 0),
