(5000002543, 2, 1, '2020-06-05T19:45:20.718+03:00', '2019-03-21T16:56:51.078+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '1000000.00', 'RUB', 0, 0, 2, 'Жилое', '30', 'кв.м.', '10.00', 'сот.', 1, 2, 'Кирпич', 0, 0, 1, 'Земли поселений', 'Кат. №: 2543. Дом находится в ст.Красноярская 10 соток,скважина,металопластиковые окна,навес,сарай,забор металопрофиля, плодоносящий сад, тихое уютное местечко,возле речки, очень хорошие соседи,что не мало важно, в доме есть ремонт.использовался как дача.Реальному покупателю скидка)', 0),
(5000002544, 2, 1, '2020-06-05T20:09:34.515+03:00', '2019-05-23T10:40:46.125+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Новый', '3300000.00', 'RUB', 0, 0, 2, 'Хорошее', '81', 'кв.м.', '8.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2544. В связи с переездом продается одноэтажный дом 2009 года постройки из пеноблока с утеплителем +сайдинг, общей площадью 80,8 м.кв. на участке 7,64 сотки. В доме 3 комнаты 16,0/14,7/9,1(все изолированные), высота потолков 2,7 м, санузел 4,9м.кв. (совмещенный), большая кухня 12,6 м.кв. (под кухней подвал), есть отдельные помещения под гардеробную и кладовку для консервации. Дом имеет чердачное пространство, высота которого позволит оборудовать мансарду. На земельном участке кроме жилого дома расположены: летняя кухня 14,9 м.кв. (пристроена к дому и имеет отдельный вход), хоз. блок, общей площадью 78,8 м.кв. включающий в себя гараж на две машины, подсобные помещения, подвал 4м.кв. для зимнего хранения овощей, сарай для хранения садового инструмента 13,5 м.кв., летний душ, уличный туалет, септик (выгребная яма, объемом 10 куб.м.), плодоносящие сад и огород. В шаговой доступности расположены школа, детский сад, продовольственные магазины, минимаркеты, магазин хозтоваров и инструментов, рынок, а также остановки общественного транспорта, откуда вы сможете удобно добраться до города Волгодонска (20 минут). В 10-и минутах езды на машине находится песчаный пляж Цимлянского водохранилища - отличное место отдыха для всей семьи.', 2009),
(5000002545, 2, 1, '2020-06-18T18:30:08.031+03:00', '2019-03-31T22:48:57.906+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '1517000.00', 'RUB', 0, 0, 2, 'Жилое', '65', 'кв.м.', '7.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2545. Жилой дом 65,9 кв.м. с земельным участком.\n\nПРОДАЖА, ОГРАНИЧЕННАЯ ПО ВРЕМЕНИ до 05.11.2021г.!\n\nДом продается на торгах по банкротству, поэтому\nИпотека, Материнский капитал или обмен для покупки не подходят!\n__________________________\nВыставлен на продажу жилой дом, площадью 65,9 кв. м. на земельном участке 7 соток.\nК дому проведен газ, электричество.\nТихий экологически чистый район.\n__________________________\nДанный объект реализуется на аукционе.\nМы поможем Вам его выкупить, выполнив за Вас все необходимые действия.\nЕсли Вы заинтересованы, но есть вопросы - мы с радостью ответим на них по телефону.', 0),
(5000002546, 2, 1, '2020-06-18T18:49:45.796+03:00', '2020-07-21T14:56:38.656+03:00', 'Россия', 'Ростовская Область', 'Дубравный п.', 'Дубравный п.', '1700000.00', 'RUB', 0, 0, 2, ' ', '147', 'кв.м.', '9.00', 'сот.', 2, 5, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2546. Новый дом в двух уровнях, без отделочных работ, в закрытом жилом комплексе для немаленькой семьи. Материал стен нижний этаж - кирпич, верхний этаж - газоблок, облицованный кирпич. Окна - металлопластиковые. В дом проведены свет, газ, вода - собственная скважина (вода отличного качества), санузел на этаж - дренажная система канализации. На участке имеются капитальные строения ( гараж и подсобное помещение) можно использовать как жилое - подведены вода и канализация. На участке высажен виноградник (столовые и винные сорта), ягоды, небольшой молодой сад.\nВ шаговой доступности Дубравненская средняя школа и детский сад, почта, активный персонал ФАП.\nЛюбителей активного отдыха порадует рыбалка на р.Кумшак в трехстах метрах от дома, соседство с Цимлянским заказником внесет гармонию и хорошее настроение. Активный торг приветствуется', 0),
(5000002547, 2, 1, '2020-06-18T19:01:54.75+03:00', '2019-03-24T17:37:21.703+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '2650000.00', 'RUB', 0, 0, 2, 'Отличное', '60', 'кв.м.', '17.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2547. В тихом ,спокойном месте, уютный ,теплый дом. С наружи после ремонта крыши ,отделки стен сайдингом Deke, с утеплителем . Новая медная проводка с заземлением.\nГазифицирован.\nПрактически вся мебель остается новому хозяину.\nГараж,подвал,хоз постройки. Задний двор с выходом в поле.Две скважины,отдельно для дома и полива огорода. Асфальтированный подъезд\nБез обременений и залогов\nВозможно участие в любых программах', 0),
(5000002550, 2, 1, '2020-06-19T16:40:37.109+03:00', '2020-06-19T16:40:37.109+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Вокзальная', '750000.00', 'RUB', 0, 0, 2, 'Жилое', '40', 'кв.м.', '8.00', 'сот.', 1, 2, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2550. Жилой дом,отопление газовое,форсунка,вода введена в дом,удобства в доме,септик 8 кубов.На участке кухня с газом,хозпостройки.Напротив дома поле,хорошее место для выпаса коз и т.д. Торг минимальный.По всем вопросам отвечу по телефону.Если не отвечаю,пишите в сообщениях.', 0),
