(5000002557, 2, 1, '2020-07-23T14:04:02.312+03:00', '2020-07-23T14:04:02.312+03:00', 'Россия', 'Ростовская Область', 'Кумшак х.', 'Кумшак х.', '1000000.00', 'RUB', 0, 0, 2, 'Жилое', '80', 'кв.м.', '20.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2557. Продаю дом.Дом большой, 3 спальни,кухня,кладовка, санузел раздельно.Площадь участка 20сот.есть хоз.постройки,сад,виноградник,есть скважина.По остальным вопросом звонить.Торг.', 0),
