(5000002559, 2, 1, '2020-07-24T19:16:20.578+03:00', '2019-06-05T16:17:06.984+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Дачный', '3500000.00', 'RUB', 0, 0, 2, ' ', '135', 'кв.м.', '8.00', 'сот.', 2, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2559. Дом готов,тепловой контур закрыт, окна энергосберегающие, строй -вариант, без отделки, вода , свет, газ на меже, канализация автономная, дом с видом на Цимлянское водохранилище, восход и закат бесподобный, 300 метров до воды.', 0),
(5000002560, 2, 1, '2020-07-25T17:44:23.562+03:00', '2019-05-22T12:20:38.625+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Краснознаменная', '4500000.00', 'RUB', 0, 0, 2, 'Хорошее', '80', 'кв.м.', '8.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2560. Дом отдельно стоящий. Кирпичный. Зал, две спальни, кухня, ванная и туалет совместно. Имеется... Летняя кухня, гараж, хоз постройки, курятник и отдельно индюшатник.', 0),
(5000002561, 2, 1, '2020-07-25T18:22:44.453+03:00', '2020-07-25T18:22:44.453+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '3950000.00', 'RUB', 0, 0, 2, 'Отличное', '106', 'кв.м.', '21.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2561. Продается крестьянско фермерское хозяйство Пять голов крупного рогатого скота, бараны, птица. Все условия для ведения фермерского хозяйства Сараи хозпостройки погреб гараж За участком большое поле для выпаса животных. Участок 21 сотка земли Плодовые деревья ягоды виноград . Натяжные потолки ламинат окна пластиковые Есть телефон интернет триколор сплитсистема газовое отопление холодная горячая вода. Дом продается с мебелью.', 0),
(5000002562, 2, 1, '2020-07-25T19:06:29.578+03:00', '2019-04-19T21:38:51.687+03:00', 'Россия', 'Ростовская Область', 'Красноярская ст.', 'Красноярская ст.', '700000.00', 'RUB', 0, 0, 2, 'Жилое', '65', 'кв.м.', '21.00', 'сот.', 1, 3, 'Дерево-брус', 0, 0, 1, 'Земли поселений', 'Кат. №: 2562. Пpoдаём дом, общ. пл. 65,4 м2: 3 кoмнаты, вeрaнда-кухня, пoдвaл, электричеcтвo, бeз oтoпления. Нa участке летний душ и туaлет, скважинa, плодонoсящий caд: яблони, абpикос, грушa, грецкий ореx и дp.; плодонoсящий виногрaдники: столoвыe и винныe copтa. Гaз подведен к участку. Тихий экологически чистый район. Хорошие соседи. Недалеко речка Кумшак, рыбалка. Земля и дом оформлены в собственность.', 0),
(5000002563, 2, 1, '2020-07-29T14:16:29.421+03:00', '2019-05-23T10:33:37.125+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Буденного', '3200000.00', 'RUB', 0, 0, 2, 'Хорошее', '90', 'кв.м.', '8.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2563. Продается дом в хорошем тихом районе, до школы и садика 5 минут, дом 2015 года постройки, 3 больших отдельных комнаты, кухня, санузел совмещён, в доме все коммуникации, везде теплые полы(водяные), большой навес, во дворе большой плодоносящий сад, большой каркасный сарай с выгулом для птицы,', 0),
(5000002564, 2, 1, '2020-08-27T17:05:07.656+03:00', '2019-05-14T19:07:40.562+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ленина', '1800000.00', 'RUB', 0, 0, 2, 'Жилое', '58', 'кв.м.', '5.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2564. Собственник. В центре Цимлянска. Рядом все соц службы и магазины. Большой гараж. Новая крыша. Высокий забор. Большая спальня, большая гостевая, гардеробная, можно сделать детскую. Кухня. Большая ванная комната. Имеется вся мебель и техника. Почти все оставляем. Продаём в связи с переездом в другой город. В гостевой идёт ремонт, новые стены и потолок, осталось обои доклеить. Кровать натуральное дерево, в идеальном состоянии, холодильник куплен в апреле и новая спит сисма, оставляем, кухонный гарнитур в идеале.', 0),
(5000002565, 2, 1, '2020-09-15T16:44:03.421+03:00', '2019-05-23T10:33:05.546+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Ломоносова', '3200000.00', 'RUB', 0, 0, 2, 'Хорошее', '75', 'кв.м.', '5.00', 'сот.', 1, 4, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2565. Продаётся дом!\nНа участке имеется:\nЛетняя Кухня с отоплением, колодец, водяная колонка, 1 сарай, 1 курятник, лётный туалет, плодовые деревья, баня с водой, гараж на 1 машину, дом, погреб.\nВ 2021 году были заасфальтированы дорожки.\nДом тёплый, электрика в норме, в доме пластиковые окна с сетками', 0),
(5000002566, 2, 1, '2020-09-15T16:48:37.968+03:00', '2020-09-15T16:48:37.968+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Суворова', '2750000.00', 'RUB', 0, 0, 2, 'Хорошее', '65', 'кв.м.', '5.00', 'сот.', 1, 3, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2566. Внимание, продается ухоженный дом площадью 64,35 кв.м с земельным участком 5 соток в тихом, уютном районе г.Цимлянска. Рядом магазины, детские сады, школа, автовокзал. Дом состоит из 3-х комнат, просторной кухни(9.3 кв.м.) прихожей, санузла, коридора. Качественный ремонт с применением современных, материалов. Вход в дом под козырьком. Интернет, телефон, сплит- система. Дом очень теплый зимой, под домом большой, теплый, сухой подвал. Забор со всех сторон изготовлен из проф.листа. На участке посажены молодые плодовые деревья, клубника, ежевика, 3 сорта смородины, крыжовник, очень много цветов. Двор чистый, ухоженный. Есть гараж(7.3?2.3). Так же есть 2-е ворота с парковочным местом для автомобиля во дворе. Летняя кухня газофицирована, водопровод, санузел, канализация. В доме и летней кухне внутри помещения установлены отдельные газовые счетчики. На участке имеются летний душ, хоз. постройки. Земля приватизирована. Дом в собственности, с документами все в порядке. Возможна продажа с ипользованием материнского капитала, ипотеки.', 0),
(5000002567, 2, 1, '2020-09-15T16:54:20.062+03:00', '2019-03-21T16:43:16.671+03:00', 'Россия', 'Ростовская Область', 'Цимлянск', 'Лермонтова', '1000000.00', 'RUB', 0, 0, 2, 'Отличное', '34', 'кв.м.', '4.00', 'сот.', 1, 2, 'Кирпич', 1, 0, 1, 'Земли поселений', 'Кат. №: 2567. Продается 1/2 дома (вход отдельный), документы в порядке, имеется 2 комнаты, кухня, коридор, косметический ремонт, пластиковые окна, линолеум, большой подвал, дом обит сайдингом светло-салатового цвета, утеплён. На территории земельного участка имеется летняя кухня в виде отдельного строения (с комнатой, помывочной и мастерской), летний душ, туалет. Между домом и отдельным строением имеется место для летнего отдыха, где можно посидеть за столом под навесом из виноградной лозы, полы выложены плиткой. Имеются насаждения ежевики, сливы. Тихая улица, спокойные соседи, в шаговой доступности магазины, рынок', 0),
